INSERT INTO `posts` (`id`, `usuario_id`, `categoria_id`, `titulo`, `texto`, `status`, `visitas`, `cadastrado_em`, `atualizado_em`, `ultima_visita_em`, `slug`, `capa`, `video`, `capa_ativa`, `valorLocacao`, `valorPatrimonio`, `valorLocacaoDia`, `valorLocacaoSemana`, `marca`, `codigo_equipamento`) VALUES
(54, 1, 46, 'Estudos feitos em 2019 com o Liner MC (Medial Congruent) da Persona', '<p><strong>Estudos feitos em 2019 com o Liner MC (Medial Congruent) da Persona</strong></p><p> </p><p>O objetivo desses estudos é para que possam entender melhor o benefícios desse liner.</p><p> </p><p><strong>Estudo 1</strong></p><ul><li><p><strong>Objetivo do estudo:</strong>&nbsp;&nbsp;avaliar a melhora clínica preliminar usando o liner Medial Congruent (MC) como nível específico de restrição.</p></li><li><p><strong>Método:</strong>&nbsp;10 pacientes (7 mulheres e 3 homens com idade média de 70,5 anos) foram submetidos a artroplastia total de joelho (ATJ). O LCP foi ressecado e a patela foi substituída em todos os casos. Posteriormente, foram aplicados 2 testes (OKS e KSS) no pré-operatório de aos 3 meses, 6 meses, e acompanhamento de 1 ano. Também usaram ??para avaliação, melhorias clínicas precoces. O exame radiológico pós-operatório foi revisado em busca de linhas radio lúcidas ou soltura dos componentes. Todos os pacientes seguiram um protocolo padrão pós-operatório idêntico de reabilitação incluindo suporte de peso conforme tolerado com muletas no 1º dia de pós-operatório.</p></li><li><p><strong>Resultados:</strong>&nbsp;A melhora média no OKS foi de 19,5 para 41,2, enquanto o KSS melhorou com uma pontuação média de 64,7 no pré-operatório para 167,5 na avaliação final, apresentando resultados de bons a excelentes em 95% dos joelhos tratados. Avaliando a amplitude de movimento, a média máxima do movimento ativo foi de 124° e nenhum dos pacientes necessitou de cirurgia de revisão ou manipulação sob anestesia. Nenhuma complicação foi observada na avaliação final como soltura séptica ou asséptica ou lesão vascular ou neurológica.</p></li></ul><p><br /><strong>Estudo 2:</strong></p><ul><li><p><strong>Objetivo do estudo:</strong>&nbsp;avaliar a satisfação subjetiva do paciente e os resultados clínicos e radiológicos em dois grupos de pacientes submetidos a ATJ primária usando polis MC e PS.</p></li><li><p><strong>Método</strong>: 100 pacientes foram submetidos a ATJ devido à osteoartrite do joelho e divididos em 2 grupos. O grupo A foi composto por 50 pacientes que utilizaram liners PS, enquanto o grupo B também foi composto por 50 pacientes que usaram o liner medialmente congruentes (MC). A técnica cirúrgica foi idêntica: equilíbrio do gap em extensão e ressecção medida em flexão; os ligamentos cruzados sempre foram removidos; o alinhamento coronal seguiu o eixo mecânico e a inclinação tibial foi fixada em 3° no grupo PS e 5° no MC. Os testes OKS e KSS foram avaliados no pré-operatório e após acompanhamento mínimo de 2 anos.</p></li><li><p><strong>Resultados:</strong>&nbsp;não houve diferenças estatísticas pré-operatórias entre os dois grupos na ADM pré-operatória média (PS 112°, MC 108°), KSS pré-operatório médio (PS 64,4, MC 63,7), OKS pré-operatório médio (PS 19,6; MC 19,0). No acompanhamento final, não houve diferenças estatísticas entre os dois grupos no OKS médio (PS 40,5; MC 41,1) e no KSS médio (OS 161,5, MC 165,7). Encontramos uma diferença estatisticamente, mas não clinicamente significativa, na ADM final: a média máxima a flexão ativa foi de 120° no grupo PS e 123° no grupo MC.</p></li><li><p><strong>Conclusão</strong>: Este estudo avaliou dois liners de polietileno biomecanicamente diferentes, mostrando que reduzir o nível de conformidade intra-articular teve efeitos mínimos nos relatos dos pacientes e nos resultados clínicos objetivos de curto prazo, mas um efeito potencialmente benéfico na amplitude de movimento (ADM). Este estudo sugere que, uma vez obtida uma estabilidade intraoperatória satisfatória, o nível mínimo de restrição deve ser usado.</p></li></ul><p> </p><p><strong>Link para acessar aos artigos na íntegra e catálogos:</strong></p><p> </p><p><a href=\"https://drive.google.com/drive/folders/1rQDK2r4N7u5bi1KZyyUiPIoHDe0MrTlN?usp=sharing\">https://drive.google.com/drive/folders/1rQDK2r4N7u5bi1KZyyUiPIoHDe0MrTlN?usp=sharing</a></p><p> </p><p> </p>', 1, 2, '2024-06-18 16:34:15', NULL, '2024-06-18 16:42:23', 'studos-feitos-em-2019-com-o-iner--edial-ongruent-da-ersona', 'studos-feitos-em-2019-com-o-iner-edial-ongruent-da-ersona.jpg', NULL, 1, 0.00, 0.00, 0.00, 0.00, NULL, NULL),
(55, 1, 47, 'Preço de dispositivos médicos importados tem perda real de 0,4% ao ano e acumula redução de mais de 5%, desde 2008.', '<p><strong>Assim como acontece com os produtos produzidos no Brasil, os itens de tecnologia médica adquiridos no exterior não exercem pressão no custo da saúde pública ou privada</strong></p><p> </p><p>O estudo ‘Índice ABIIS Importação’ que analisou os preços praticados, nos últimos 13 anos, na importação de produtos médico-hospitalares – dispositivos médicos implantáveis (DMIs); reagentes e analisadores para diagnóstico in vitro; e materiais e equipamentos para a saúde – tiveram defasagem média de 0,4% ao ano e acumulam uma perda real de 5,2%, no período entre 2008 e 2021. Todos os valores foram convertidos para o Real e atualizados por índice de inflação, medido pelo IGP-M.</p><p> </p><p>“Assim como acontece com os produtos produzidos no Brasil, os itens de tecnologia médica adquiridos no exterior – que correspondem a 49% do consumo brasileiro – não exercem pressão no custo da saúde pública ou privada”, afirma o diretor executivo da Aliança Brasileira da Indústria Inovadora em Saúde, José Márcio Cerqueira Gomes, com base no estudo encomendado.</p><p> </p><p>Os produtos da cesta DMIs foram os que mais tiveram defasagem de preço: -2% a.a.&nbsp;(em média) e -24,2% no acumulado de 2028 a 2021. Esse grupo é composto por órteses, próteses, materiais especiais e itens de apoio. Reagentes e analisadores para diagnóstico in-vitro desvalorizaram -0,5% a.a. e -6,3% no período estudado. O único segmento do setor cujos produtos importados mostraram valorização real foi o de materiais e equipamentos para a saúde – audiologia, cardiovascular, odontologia, oftalmologia, EPIs, mobiliário: 0,6% a.a. e 8,4% nos 13 anos. “Vale lembrar que aprimoramentos tecnológicos e o contexto macroeconômico também exercem pressão nos itens importados, com a continua desvalorização do real, principalmente de 2015 para cá. Esses dados preocupam porque colocam em risco a sustentabilidade do setor saúde como um todo”, destaca Gomes.</p><p> </p><p>As variações estimadas no ‘Índice ABIIS Importação’ referem-se aos preços dos produtos praticados no porto. Não captam os valores finais dos mesmos produtos que são praticados pelas empresas e nem as compras públicas, no sistema público, ou as compras privadas, que prestam serviços médicos utilizando-se desses produtos.</p><p> </p><p>O estudo ‘Índice ABIIS Importação’ foi realizado pelos economistas Emerson Fernandes Marçal - coordenador do Centro de Macroeconomia Aplicada da FGV-EESP. Tem experiência na área de Finanças e Macroeco­nomia Aplicada, com ênfase em Métodos Quantitativos e Análise de Séries de Tempo; e Patrícia Marrone - sócia-diretora da Websetorial.</p><p> </p><p>Fonte:&nbsp;<a href=\"https://www.saudebusiness.com/industria/preco-de-dispositivos-medicos-importados-tem-perda-real-de-04-ao-ano-e-acumula-reducao-de\">https://www.saudebusiness.com/industria/preco-de-dispositivos-medicos-importados-tem-perda-real-de-04-ao-ano-e-acumula-reducao-de</a></p>', 1, 0, '2024-06-18 16:36:36', NULL, NULL, 'reco-de-dispositivos-medicos-importados-tem-perda-real-de-0-4-ao-ano-e-acumula-reducao-de-mais-de-5-desde-2008', 'reco-de-dispositivos-medicos-importados-tem-perda-real-de-0-4-ao-ano-e-acumula-reducao-de-mais-de-5-desde-2008.jpg', NULL, 1, 0.00, 0.00, 0.00, 0.00, NULL, NULL),
(56, 1, 47, 'DISTORÇÕES NA SAÚDE PRECISAM ACABAR', '<p>Sérgio Rocha, presidente da Associação Brasileira de Importadores e Distribuidores de Produtos para Saúde (Abraidi) | 26 Jun, 2023</p><p> </p><p> </p><p><strong>Números da pesquisa da ABRAIDI revelam que o volume pendente de faturamento nos distribuidores atingiu a marca de R$ 1,085 bilhão</strong></p><p> </p><p>Há quase uma década temos denunciado as distorções praticadas pelo mercado e, nos últimos seis anos, mensurado o montante destas anomalias que comprometem o fluxo de caixa de distribuidores e importadores de produtos para a saúde e a sustentabilidade de todo o setor. Nesse ano constatamos um valor ainda mais assustador de recursos contingenciados por planos de saúde e hospitais, que chegou a&nbsp;R$ 2,1 bilhões.</p><p> </p><p>As distorções praticadas representam 23,1% do faturamento das distribuidoras e importadoras de produtos para a saúde, sendo que as retenções de faturamento são 12%, a inadimplência ou calote é de 9,5% e as glosas, 1,6% do faturamento.</p><p> </p><p>A retenção de faturamento é quando a fonte pagadora, após a realização de uma cirurgia previamente autorizada, não permite o faturamento dos produtos consumidos, postergando assim o pagamento. Corroborando uma percepção do mercado de que a distorção piorou nos últimos 12 meses, os números da pesquisa da ABRAIDI&nbsp;revelam que o volume pendente de faturamento atingiu a insustentável marca de R$ 1,085 bilhão, um aumento de quase 50% em relação ao ano passado. Além de ser uma prática antiética e comercialmente questionável, trata-se também de uma iniciativa abusiva por parte das fontes pagadoras. A legislação brasileira dispõe que todo consumo de produto seja faturado dentro do mês correspondente ao seu uso. O tempo médio para o recebimento a partir do dia que foi realizada a cirurgia é de 116 dias.</p><p> </p><p>O levantamento revelou também que a ampla maioria das empresas associadas à ABRAIDI sofre com glosas injustificadas, cerca de 80%, porcentagem muito parecida com a constatada no trabalho anterior. Muito embora a frequência tenha permanecido a mesma, o volume de recursos glosados representou um aumento de 24,3% em relação à 2022 e atingiu o valor nominal de R$ 145 milhões. Além disso, é importante destacar a alta ocorrência de indeferimento de pagamento em procedimentos eletivos previamente autorizados pelas operadoras ou hospitais. A pesquisa demonstrou que cerca de 40% dos procedimentos em que houve a prática de glosa referem-se a cirurgias autorizadas com antecedência.</p><p>Já a inadimplência atingiu R$ 864 milhões, maior índice da série histórica e cerca de 40% superior ao valor do ano anterior que foi de R$ 610 milhões.</p><p> </p><p>O crescimento exponencial das distorções no setor da saúde vai ao encontro de uma série de medidas adotadas pelas fontes pagadoras, relacionadas a modelos de negócios e remuneração. Percebe-se no mercado uma intensificação da verticalização, onde a operadora detém a própria rede de prestadores de serviços, como hospitais, ficando a cargo de cada unidade a compra de produtos. É imperioso destacar o aumento de novos modelos de remuneração, principalmente, a adoção do pagamento por pacote, que tem como objetivo aumentar a previsibilidade dos custos relacionados ao procedimento. Se, no início desse processo, os planos de saúde negociavam diretamente com fornecedores na tentativa de reduzir custos, com o tempo delegaram essa responsabilidade para os hospitais, fossem da rede própria ou não. Isso fez com que as negociações de preços, prazos, bem como os pagamentos fossem efetuados por esses prestadores, agravando a retenção do faturamento, distorção com maior volume financeiro contingenciado.</p><p> </p><p>Os distribuidores e importadores são as menores empresas, em relação ao faturamento do ecossistema de saúde no Brasil, mas acabam financiando as gigantes, como planos e hospitais. A questão é que ‘bancamos’ de forma impositiva e, na maioria das vezes, com práticas comerciais antiéticas que excluem aqueles que não aceitam as ‘regras’ impostas. A deterioração, ano após ano, como constatado em nossas pesquisas, revela que algo precisa ser feito urgentemente para acabar com essas práticas.</p><p> </p><p>Fonte:&nbsp;<a href=\"https://www.saudebusiness.com/industria/distorcoes-na-saude-precisam-acabar\">https://www.saudebusiness.com/industria/distorcoes-na-saude-precisam-acabar</a></p><p> </p>', 1, 0, '2024-06-18 16:39:42', NULL, NULL, 'co--u--', 'co-u.jpg', NULL, 1, 0.00, 0.00, 0.00, 0.00, NULL, NULL);
