(10000, 1, 15, 'iusto-quo-officia-enim-labore-ad.jpg', 'iusto-quo-officia-enim-labore-ad', 'Iusto quo officia enim labore ad.', '<p>Hatter, &#39;you wouldn&#39;t talk about her pet: &#39;Dinah&#39;s our cat. And she&#39;s such a neck as that! No, no! You&#39;re a serpent; and there&#39;s no harm in trying.&#39; So she called softly after it, and yet it was.</p>', 1, 84607, '2010-07-21 05:48:59', '2024-01-27 01:50:01', '2024-01-27 23:23:15', 1),
(10001, 1, 16, 'novo-postizinho.jpg', 'novo-postizinho', 'Novo postizinho', '<p><strong>O empres&aacute;rio Walter Macarini,</strong> ex-diretor da Folha de Londrina, morreu no in&iacute;cio da tarde desta sexta-feira (26), aos 82 anos, na cidade que escolheu para chamar de sua. Amante dos esportes, era comum &ldquo;trombar&rdquo; com Macarini pelo Zer&atilde;o enquanto ele fazia suas costumeiras caminhadas.&nbsp;</p><p>&nbsp;</p><p>Ap&oacute;s dores constantes nos dedos dos p&eacute;s nas &uacute;ltimas semanas, o catarinense de nascimento foi diagnosticado com uma compress&atilde;o na medula espinhal e precisou passar por uma cirurgia. Apesar do sucesso no procedimento, o empres&aacute;rio teve uma infec&ccedil;&atilde;o de urina, que evoluiu para uma sepse e, em seguida, foi v&iacute;tima de uma parada card&iacute;aca. Macarini faleceu &agrave;s 13h desta sexta-feira.</p>', 1, 7, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2024-01-27 23:26:10', 1),
(10002, 1, 19, 'video-aula.mp4', 'video-aula', 'Video Aula', '<p>Video Aula de exemplo</p><p>&nbsp;</p><p>&nbsp;</p><ul><li>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</li><li>Cras sagittis diam at sapien interdum ornare faucibus vel mi.</li><li>Vestibulum tempus nulla at velit semper, sit amet dignissim purus dignissim.</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Donec non risus eu nisl scelerisque congue non sed massa.</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Pellentesque elementum nisi at neque feugiat, et ultrices quam rutrum.</li><li>Maecenas at eros varius, vehicula nunc nec, suscipit ligula.</li></ul><p>&nbsp;</p><p>&nbsp;</p><ul><li>Nulla auctor mauris ac enim rutrum, non ornare leo efficitur.</li><li>Cras et urna ac arcu dictum mattis.</li><li>Etiam eu elit luctus, suscipit diam non, fringilla nisl.</li><li>Praesent ac est sit amet est luctus euismod vel nec quam.</li><li>Maecenas ut mauris pretium, efficitur quam nec, faucibus purus.</li></ul><p>Aenean blandit dolor vitae ligula rutrum, quis lacinia dui gravida.</p><p>https://www.youtube.com/watch?v=0gHUQczK3uc</p>', 1, 19, '0000-00-00 00:00:00', '2024-01-27 23:08:56', '2024-01-27 23:26:16', 1),
