INSERT INTO `produtos` (`id`, `usuario_id`, `categoria_id`, `titulo`, `sub_titulo`, `forma_convenio`, `ordenacao`, `texto`, `indicacoes`, `status`, `visitas`, `cadastrado_em`, `atualizado_em`, `ultima_visita_em`, `slug`, `capa`, `texto_botao_1`, `capa_botao_1`, `texto_botao_2`, `capa_botao_2`, `texto_botao_3`, `capa_botao_3`, `video`) VALUES
(1, 1, 43, 'Prótese Total de Joelho Persona', 'Implantes personalizados projetados para ajuste e função ideais.', 'Prótese total de joelho Persona com lateralidade de tíbia. Polietileno PS ou CR com incrementos de 1mm em 1mm e Fêmur Estreito ou Standard', '1', '<p>Ao projetar o Persona Knee, usamos uma combinação de ferramentas de pesquisa avançada para estudar centenas de joelhos. Ao fazer isso, confirmamos que a forma do implante realmente importa. O ajuste realmente importa. Instrumentação e tecnologia realmente importam. O Persona Knee foi projetado com todos esses elementos em mente, porque acreditamos que uma maneira de melhorar previsivelmente a satisfação do paciente é reproduzir mais fielmente o original.</p><p>A Prótese Persona é o sistema de joelho mais abrangente, incluindo componentes anatomicamente precisos com incrementos mais finos para ajudar os cirurgiões a personalizar o ajuste para cada paciente e restaurar a identidade única de cada joelho.</p><p>Implantes anatomicamente precisos projetados para ajuste e função ideais.</p><p>O design anatômico da tíbia ajuda a evitar má rotação, facilitando a rotação adequada e a cobertura óssea ideal. Estudos indicam que a má rotação interna dos implantes pode levar a mais de 50% dos casos dolorosos de ATJ.</p><p>21 perfis femorais distintos, com incrementos de 2 mm disponíveis em padrão e estreito, fornecem o esquema de dimensionamento femoral mais abrangente do mercado.<br />Restaure o equilíbrio do ligamento com cinco níveis de restrição em incrementos de 1mm.</p><p>Instrumentação precisa com controle personalizado.</p><p>A Prótese de Joelho Persona&nbsp;foi projetada para ser versátil, precisa em suas medições, abrangente e confortável com uso repetitivo. Essas opções foram projetadas para ajudá-lo a alcançar resultados ideais de forma consistente. Tecnologia comprovada construída sobre um legado de desempenho clínico.</p><p><a href=\"https://zimmerbiomet.tv/videos/1613?a=surgeon\">https://zimmerbiomet.tv/videos/1613?a=surgeon</a></p><p><a href=\"https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/persona-knee-system.html\">https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/persona-knee-system.html</a></p>', '<ul><li><p>Substituição Total do Joelho</p></li><li><p>Prótese Total de Joelho Primária</p></li><li><p>Cimentada ou Não cimentada</p></li></ul>', 1, 3, '2024-06-18 14:47:03', '2024-06-18 14:59:50', '2024-06-18 16:25:37', 'protese-total-de-joelho-persona', 'protese-total-de-joelho-persona.jpg', 'The Personalized Knee', 'protese-total-de-joelho-persona_1.pdf', 'The Story', 'protese-total-de-joelho-persona_1.pdf', 'Técnica Cirurgica', 'protese-total-de-joelho-persona.pdf', NULL),
(2, 1, 43, 'Âncora FastFit Razek', 'DESIGN BASEADO NOS PRINCÍPIOS DE MÍNIMA AGRESSÃO E MAIOR PODER DE FIXAÇÃO.', 'A DEFINIR', '1', '<p>A família de âncoras de sutura flexível FastFit Anchor Razek é indicada para utilização em procedimentos cirúrgicos ortopédicos artroscópicos ou convencionais nos membros superiores e inferiores, nos quais a sutura é utilizada para unir tecidos moles como ligamentos, tendões ou cápsulas articulares ao osso.</p><p> </p><p><strong>Especificações Técnicas</strong></p><ul><li>Disponíveis em três diâmetros: 1,6 mm, 2,0 mm e 2,5 mm – carregadas com fios de altíssima resistência (UHMWPE * ForceFiber® Teleflex *);</li><li>Reduzida remoção de osso – a broca de menor diâmetro faz com que o orifício criado para o implante seja muito menor. Consequentemente, há uma preservação maior da superfície de contato osso-tecido, além de menor agressão, diminuindo consideravelmente a dor durante o pós-cirúrgico;</li><li>Há minimização de complicações como fraturas, ostólises e sinovites, que podem ocorrer com outros materiais, principalmente nos bioabsorvíveis;</li><li>O diâmetro reduzido da âncora diminui a necessidade de maiores perfurações ósseas, comuns em âncoras metálicas, peek e bioabsorvíveis, fazendo com que complicações como fragilidade óssea e relesões sejam minimizadas. Além disso, nos casos em que mais âncoras sejam necessárias, haverá menor chance de complicações e maior possibilidade para o seu adequado posicionamento;</li><li>Com o implante totalmente baseado em fios de sutura, elimina-se a possibilidade de corpos livres intra-articulares que podem ocorrer em outros tipos de implantes.</li></ul>', '', 1, 3, '2024-06-18 15:06:15', '2024-06-18 15:11:56', '2024-06-18 15:29:45', 'ancora-fastfit-razek', 'ancora-fastfit-razek.jpg', 'Catálogo', 'ancora-fastfit-razek.pdf', 'Manual', 'ancora-fastfit-razek.pdf', '', NULL, NULL),
(3, 1, 43, 'Âncora JuggerKnot ®', 'The Leader in All-Suture Anchors.', 'ÂNCORA FLEXÍVEL JUGGERKNOT', '1', '<p>Zimmer Biomet redefiniu completamente como a reparação do tecido é realizado com o design da Âncora JuggerKnot. Um artigo publicado pela PRWeb em março de 2013 afirmou: \"Atualmente, existem dois grandes desenvolvimentos no mercado de dispositivos ortopédicos nos EUA que estão produzindo impactos drásticos no mercado de biomateriais de tecido mole e ortopedia. Devido às&nbsp;&nbsp; inovações tecnológicas do líder de mercado Zimmer Biomet, pacientes com lesões de ombro ou danos no manguito rotator causados por lesões desportivas ou relacionadas à idade, podem agora&nbsp;&nbsp; esperar restauração de melhor qualidade \".</p><p>A premiada Âncora JuggerKnot 100% de sutura evoluiu rapidamente para uma família de âncoras que oferecem opções de dimensionamento para muitos procedimentos diferentes.</p><p> </p><p><strong>Elas são pequenas</strong></p><ul><li><p>O volume de osso que é removido com uma broca de 3,0 mm é equivalente a quatro furos de&nbsp;&nbsp;&nbsp; perfuração de JuggerKnot 1,5 mm;</p></li><li><p>Reduz a remoção do osso;</p></li><li><p>O tamanho da broca de menor diâmetro reduz a probabilidade de cruzar túneis de ancoragem ao colocar múltiplas âncoras;</p></li><li><p>Permite pontos múltiplos de fixação ao reparar tecido macio ao osso;</p></li></ul><p><strong>Elas são fortes</strong></p><ul><li><p>A força é igual ou maior do que algumas âncoras duas ou três vezes maiores;</p></li><li><p>Alta resistência à retirada;</p></li></ul><p><strong>Elas são All-Suture</strong></p><ul><li><p>Sistema de implantação de âncora macia sem componente rígido;</p></li><li><p>Elimina a possibilidade de materiais rígidos soltos na articulação;</p></li><li><p>Facilita cirurgia de revisão;</p></li></ul><p><strong>E agora elas não têm nó</strong></p><ul><li><p>Capacidade de controlar a tensão da âncora;</p></li><li><p>Nenhum nó amarrado na mão;</p></li><li><p>JuggerKnot demonstrou 57 libras de força;</p></li></ul><p><strong>Primeira Âncora All-Suture sem nó</strong></p><p>A experiência clínica do Âncora JuggerKnot e o inovador design sem nó da tecnologia ZipLoop™ prepararam as bases para o desenvolvimento da Âncora macia JuggerKnot. A Âncora macia JuggerKnot é projetada para a reestruturação do tecido macio ao osso sem o incômodo de amarrar os nós cirúrgicos. É a primeira âncora sem nó all-suture no mercado. O design da âncora permite aos cirurgiões a capacidade de controlar a tensão da âncora com as mãos. Além disso, este design fornece uma opção de tamanho único para todos, o que pode reduzir a necessidade de transportar vários tamanhos no inventário.</p>', '<p><strong>Ombro:</strong></p><p>Reparação de lesões de Bankart;</p><p>Reparação de lesão SLAP;</p><p>Reparação acromio clavicular;</p><p>Deslocamento capsular/reconstrução capsolabral;</p><p>Reparação de Deltóide;</p><p>Reparo da lesão do manguito rotador;</p><p>Tenodese do bíceps;</p><p> </p><p><strong>Cotovelo:</strong></p><p>Reconstrução do ligamento colateral ulnar ou radial;</p><p>Reparação da epicondilite lateral;</p><p>Reconexão do tendão do bíceps;</p><p> </p><p><strong>Mão e Punho:</strong></p><p>Reparação do Ligamento colateral;</p><p>Reconstrução do ligamento escapular;</p><p>Transferência de tendões na falange;</p><p>Reconstrução de placas Volar;</p><p> </p><p><strong>Quadril:</strong></p><p>Reparaçao do labro acetabular;</p><p> </p><p><strong>Joelho:</strong></p><p>Reparação extra-capsular: MCL, LCL e ligamento oblíquo posterior;</p><p>Tenodese da banda iliotibial;</p><p>Reparo do tendão da patela;</p><p>VMO avanço;</p><p>Fechamento da cápsula conjunta;</p><p> </p><p><strong>Pé e Tornozelo:</strong></p><p>Reparação e reconstrução medial / lateral;</p><p>Reparo do meio e do antepé;</p><p>Reconstrução do Hallux Valgus;</p><p>Reparação ou reconstrução do ligamento / tendão metatarso;</p><p>Reparação do tendão de Aquiles;</p>', 1, 2, '2024-06-18 15:19:51', '2024-06-18 15:32:37', '2024-06-18 15:46:39', 'ancora-uggernot-', 'ancora-juggerknot.jpg', 'Catálogo', 'ancora-juggerknot.pdf', 'Informativo', 'ancora-juggerknot.pdf', '', NULL, NULL),
(4, 1, 43, 'Chondro-Gide® - Substituto de cartilagens', 'Chondro-Gide® é a melhor matriz de colágeno dupla face e natural para a regeneração de cartilagem. Esta matriz fácil de manusear pode ser usada para tratar defeitos da cartilagem com vários métodos cirúrgicos. Chondro-Gide® consiste em colágeno natural. A', 'MEMBRANA CHONDRO-GIDE', '1', '<p><strong>Técnicas cirúrgicas que&nbsp;utilizam a&nbsp;Chondro-Gide®</strong></p><ul><li>AMIC®&nbsp;(condrogênese autóloga induzida por matriz)&nbsp;é uma técnica de um único passo, com uma boa relação&nbsp;custo/benefício e eficaz para o tratamento de defeitos traumáticos da cartilagem. Chondro-Gide®&nbsp;oferece um ambiente protetor para a diferenciação celular e a formação de nova cartilagem.</li><li>ACI (implante autólogo de condrócitos): Chondro-Gide®&nbsp;oferece uma matriz de suporte 3D ideal para a adesão de condrócitos autólogos de cultura e promove a sua proliferação.</li></ul><p><br /><strong>Benefícios clínicos do Chondro-Gide®</strong></p><ul><li>Estudos científicos comprovam a eficiência do Chondro-Gide®&nbsp;como a melhor matriz de colágeno na regeneração da cartilagem</li><li>A matriz tem uma estrutura dupla face exclusiva</li><li>Chondro-Gide®&nbsp;possui uma elevada resistência à tração e excelentes propriedades de manuseio</li><li>Chondro-Gide®&nbsp;promove a condrogênese das células-tronco mesenquimais na técnica AMIC®</li><li>Chondro-Gide®&nbsp;promove a proliferação e o enriquecimento da matriz extracelular no ACI.</li></ul><p> </p><p><strong>Linha&nbsp;de produtos Chondro-Gide®&nbsp;para as várias indicações</strong></p><p>Chondro-Gide®&nbsp;pode ser usado no tratamento dos defeitos de cartilagem de vários tamanhos. Três tamanhos diferentes do produto permitem ao cirurgião optar pelo mais adequado. Para a obtenção do tamanho ideal, a matriz pode ser cortada&nbsp;na condição&nbsp;seca&nbsp;ou úmida.<br />Os produtos da Geistlich Pharma apresentam uma elevada reputação&nbsp;ao longo do&nbsp;mundo, sendo usados e recomendados pelos melhores médicos. Os nossos produtos são fabricados segundo padrões de alta qualidade e são sujeitos a análise científica e testes independentes.</p><p> </p><p><strong>AMIC®&nbsp;- Condrogénese induzida por matriz autógena</strong></p><p>A condrogênese induzida por matriz autógena, AMIC®, é um inovador procedimento cirúrgico biológico desenvolvido pela Geistlich Surgery para o tratamento de lesões traumáticas condrais e osteocondrais. Este procedimento de passo único combina o método de microfraturação, que é um tratamento de primeira linha estabelecido, com a aplicação&nbsp;da Chondro-Gide®, uma matriz&nbsp;dupla-face de colágeno de origem suína.</p><p>O princípio funcional da microfraturação baseia-se na libertação de células progenitoras mesenquimais multipotentes, citocinas e fatores de crescimento de osso subcondral. O supercoágulo formado como resultado da hemorragia é coberto e depois estabilizado pela matriz Chondro-Gide®&nbsp;e por cola de fibrina. Chondro-Gide®&nbsp;constitui uma estrutura de suporte apropriada, que realça a diferenciação condrogénica de células-tronco mesenquimais e, em combinação com cola de fibrina, estimula os condrócitos para aumentar a deposição de proteoglicanos. AMIC®&nbsp;alcança alívio da dor e restaura a funcionalidade da articulação, com o objetivo de recuperar a mobilidade completa, permitindo voltar ao estilo de vida e nível de vida anteriores. Retarda a degeneração de cartilagem, com o objetivo de evitar ou abrandar a cirurgia de substituição parcial ou total da articulação (substituição do joelho).</p>', '<ul><li>Lesões condrais e osteocondrais de grau III–IV (classificação de Outerbridge).</li><li>Defeitos traumáticos focais.</li><li>Tamanho do defeito, aprox. 1,0 – 8,0 cm2.</li><li>Pacientes com idades entre 18 e 55 anos.</li></ul>', 1, 4, '2024-06-18 15:38:01', NULL, '2024-06-18 15:46:30', 'hondro-ide-ubstituto-de-cartilagens', 'hondro-ide-ubstituto-de-cartilagens.jpg', 'Catálogo Quadril', 'hondro-ide-ubstituto-de-cartilagens.pdf', 'Catálogo Tornozelo', 'hondro-ide-ubstituto-de-cartilagens.pdf', 'Catálogo Joelho', 'hondro-ide-ubstituto-de-cartilagens.pdf', NULL),
(5, 1, 43, 'Orthoss - Substituto (Enxerto) Ósseo', 'Orthoss® é um substituto ósseo bioderivado feito de osso bovino mineral altamente purificado. Ele é produzido na Suíça, seguindo um rigoroso sistema de garantia de qualidade para garantir sua segurança e qualidade. Esta ilustração mostra como Orthoss® tra', 'Orthoss block bloco ou granulado', '1', '<p>Orthoss® é usado como uma alternativa ao osso autólogo no preenchimento de defeitos ósseos menores. Durante o tratamento de defeitos grandes, Orthoss® é adequado como um incremento de volume para enxertia óssea combinada usando 25% do osso autólogo ou de aspirado de medula óssea.</p><p> </p><p><strong>ELEVADA SEMELHANÇA AO OSSO HUMANO</strong></p><p>Orthoss® é muito semelhante ao osso humano. Como o osso humano, ele é bastante poroso e tem uma estrutura de poros exclusiva, formada por nanoporos e macroporos.</p><p> </p><p><strong>NANOPOROS</strong></p><p>A presença e a interligação de um grande número de nanoporos (10–20 nm) produzem a alta capilaridade de Orthoss® e contribuem para sua alta hidrofilia. Incorporados nas paredes dos macroporos, eles permitem que Orthoss® se fixe espontaneamente e retenha um grande volume de sangue e outros fluidos.</p><p> </p><p><strong>MACROPOROS</strong></p><p>Os macroporos (100–300 μm) permitem o movimento e a adesão das células formadoras de ossos por toda a estrutura do Orthoss®. Eles fornecem o espaço para que os vasos sanguíneos e as comunidades de células cresçam.</p><p> </p><p><strong>INTERLIGAÇÃO</strong></p><p>Orthoss® fornece uma rede de poros interligados, que funcionam como canais para todos os elementos necessários para o crescimento do osso, como o sangue. Essa rede permite a rápida absorção do sangue, promove a revitalização através de novos vasos sanguíneos e permite o crescimento guiado de osso novo.</p><p> </p><p><strong>COLONIZAÇÃO</strong></p><p>Imediatamente a pós a cirurgia, as células entram na rede interligada d e poros, onde eles podem se fixar, proliferar e se diferenciar.</p><p> </p><p><strong>INTEGRAÇÃO</strong></p><p>Após a cirurgia, Orthoss® se comporta de forma muito semelhante a o osso humano, à medida em que é incorporado ao osso circundante. Sua excepcional osseointegração deve-se à sua exclusiva estrutura de poros bimodal, com nano e macroporos, que promove a cura, fomentando a formação d e n ovos vasos sanguíneos e novo tecido ósseo.</p><p> </p><p><strong>REMODELAGEM</strong></p><p>Nos meses e anos seguintes, o equilíbrio entre a taxa de reabsorção do material de enxerto ósseo e a taxa de formação de tecido ósseo é fundamental.</p><p> </p><p><strong>ORTHOSS® É REABSORVIDO</strong></p><p>lentamente, fornecendo uma estrutura estável que mantém o volume da área reparada enquanto o novo tecido ósseo cresce. A estrutura do Orthoss® permanece no local até que o novo osso esteja pronto para tomar o seu lugar. O resultado é uma reparação de longa duração que se mantém estável e forte a longo prazo.</p>', '<p>Regeneração óssea em indicações assépticas. Estão incluídas nessas indicações o preenchimento de defeitos, reconstrução em ortopedia e cirurgia da coluna vertebral.</p><p> </p><p>Orthoss® pode ser usado:</p><ul><li>Para o preenchimento e reconstrução de defeitos ósseos em condições assépticas, por exemplo<ul><li>Após tratamentos envolvendo fixação de fraturas</li><li>Após osteotomia</li><li>Para preenchimento de áreas doadoras de osso autógeno</li><li>Após a ressecção de um tumor benigno e a curetagem de cisto ósseo</li><li>Após a remoção de implantes metálicos</li></ul></li><li>Em cirurgia da coluna vertebral, por exemplo, durante a reconstrução de defeitos vertebrais ou durante a fusão intercorporal como material de preenchimento da gaiola ou de fusão póstero-lateral</li><li>Para reconstrução óssea durante a artroplastia e a artroplastia de revisão</li><li>Como enxerto composto no tratamento de fraturas não consolidadas e pseudartroses</li><li>Durante a artrodese</li></ul>', 1, 1, '2024-06-18 15:50:20', NULL, '2024-06-18 15:50:48', 'rthoss-ubstituto-nxerto-osseo', 'rthoss-ubstituto-nxerto-osseo.jpg', 'Catálogo', 'rthoss-ubstituto-nxerto-osseo.pdf', 'Catálogo 2', 'rthoss-ubstituto-nxerto-osseo.pdf', 'Vídeo', 'rthoss-ubstituto-nxerto-osseo.mp4', NULL),
(6, 1, 43, 'Dispositivo de reparo meniscal CrossFix®', 'Reparo All-Inside com resultados Inside-Out. O CrossFix lI Meniscal Repair System é um dispositivo apenas de sutura que cria um ponto colchão instantâneo para um reparo meniscal rápido, forte e confiável.', 'DISPOSITIVO REPARO MENISCAL CROSSFIX', '1', '<p>O Dispositivo de Reparo Meniscal Crossfix, da Zimmer Biomet,&nbsp;é uma plataforma de sutura do menisco, totalmente interna, projetada para reparos \"all in\" com resultados semelhantes ao \"inside out\" . Seu design de agulha dupla o torna ideal para resultados consistentes, confiáveis e rápidos, transformando a cirurgia em um processo simples.</p><p> </p><p>O dispositivo de sutura apenas elimina preocupações associadas a implantes rígidos;</p><p>Agulhas curvas e retas permitem o acesso a vários locais de rasgo;</p><p>Sutura de alta resistência para fácil deslizamento do nó e alta resistência à quebra do nó</p><p>Agulhas mais afiadas e rígidas melhoram a entrega e a consistência</p><p>Limitador de profundidade incorporado fornece controle de penetração da agulha</p><p> </p><ul><li>Técnica de reprodução fácil e rápida</li><li>Agulhas mais fortes e rígidas</li><li>Força de sutura aprimorada</li></ul>', '', 1, 1, '2024-06-18 16:13:10', '2024-06-19 10:22:26', '2024-06-19 10:22:31', 'dispositivo-de-reparo-meniscal-crossfixr', 'ispositivo-de-reparo-meniscal-rossix.jpg', 'Técnica Cirúrgica', 'ispositivo-de-reparo-meniscal-rossix.pdf', 'Catálogo', 'ispositivo-de-reparo-meniscal-rossix.pdf', 'Vídeo', 'ispositivo-de-reparo-meniscal-rossix.mp4', NULL),
(7, 1, 43, 'Fio de Alta Resistência - STITCH', 'Os produtos da linha Stitch - Fios de Sutura e Fitas de alta resistência GMReis são confeccionados com o polímero UHMWPE – polietileno de ultra alto peso molecular, trançados de forma a proporcionar elevada resistência à tração e resistência sobre nó, des', 'A DEFINIR', '1', '<p><strong>Fios e Fitas de sutura não absorvíveis, trançados e de alta resistência.</strong></p><p> </p><ul><li>Alta resistência contra: abrasão, quebra, alongamento, soltura ou afrouxamento de nós;</li><li>Excelente biocompatibilidade, e compatibilidade com implantes metálicos e poliméricos;</li><li>Extremidade agulhada para sutura;</li><li>Opções de fio e fitas com cores diferentes facilitam a organização durante o procedimento;</li><li>Matéria-prima: UHMWPE (polietileno de ultra alto peso molecular). Com o implante totalmente baseado em fios de sutura, elimina-se a possibilidade de corpos livres intra-articulares que podem ocorrer em outros tipos de implantes.</li></ul>', '<p>A DEFINIR</p>', 1, 1, '2024-06-18 16:16:34', '2024-06-18 16:16:54', '2024-06-18 16:17:04', 'io-de-lta-esistencia-', 'io-de-lta-esistencia.jpg', 'Catálogo', 'io-de-lta-esistencia.pdf', '', NULL, '', NULL, NULL),
(8, 1, 43, 'G3 Cimento Ósseo Macom G21', 'G3 CIMENTOS DE BAIXA VISCOSIDADE. ', 'CIMENTO OSSEO PARA ORTOPEDIA G3', '1', '<p>Cimento ósseo radiopaco de base acrílica com consistência e tempo de manipulação particularmente adequado para cimentação de próteses de quadril e, quando necessário, em pequenas e médias articulações. Ideal para uso com sistemas de mistura e injeção. As versões com antibiótico são indicadas para operações de revisão bem como em casos que sugerem risco de infecções causadas por organismos sensitivos à gentamicina. Tem sido demonstrado que a aplicação local de antibióticos por meio de cimento ósseo reduz o risco de desprendimento séptico da prótese, assegurando alta taxa de liberação do ingrediente ativo na área do implante mantendo a concentração do nível sistêmico baixo.</p><p> </p><p>CARACTERÍSTICAS:</p><ul><li>Reduzido tempo de mistura (em minutos obtém-se um produto homogênio);</li><li>Tempo de trabalho adequado ao tipo de aplicação (6-8 minutos);</li><li>Polimerização completa após 13 minutos o que reduz o risco de micro deslocamentos da prótese, uma vez aplicado;</li><li>Excelentes propriedades mecânicas;</li><li>Baixa temperatura de polimerização, implicando na redução do risco de choque térmico nos tecidos;</li><li>Polímero de alto peso molecular possibilitando melhor resistência de fadiga do implante</li></ul>', '<p>A DEFINIR</p>', 1, 0, '2024-06-18 16:20:29', NULL, NULL, '3-imento-osseo-acom-21', '3-imento-osseo-acom-21.jpg', 'Catálogo', '3-imento-osseo-acom-21.pdf', '', NULL, '', NULL, NULL),
(9, 1, 43, 'Cimento Ósseo HI–FATIGUE', 'O Hi-Fatigue Bone Cement é uma resina sintética de endurecimento rápido com adição de sulfato de gentamicina para cirurgia óssea.', 'HI-FATIGUE CIMENTO SEM ANTIBIÓTICO OU COM', '1', '<p>O&nbsp;<em>Hi-Fatigue&nbsp;</em>Bone Cement é uma resina sintética de endurecimento rápido com adição de sulfato de gentamicina para cirurgia óssea. Após misturar os dois componentes estéreis separados, forma-se um cimento ósseo flexível que, após endurecer por completo, fixa o implante e transfere as forças resultantes do decurso de um movimento para o osso, de modo uniforme. A adição de sulfato de gentamicina ao antibiótico confere ao implante e aos tecidos envolventes proteção contra uma colonização por agentes patogênicos sensíveis à gentamicina. Como contraste radiopaco, o cimento em pó Hi-Fatigue contém dióxido de zircónio insolúvel. O Hi-Fatigue não emite nenhum sinal num dispositivo de ressonância magnética nuclear e é facilmente visualizado na zona a operar através de sua coloração clara.</p><p>O Hi-Fatigue Bone Cement está indicado para a fixação de componentes de próteses de resina sintética e metálicas, na substituição parcial ou total da articulação coxo-femoral, do joelho e de outras articulações, caso esteja comprovada ou se suspeite de uma infecção com germes sensíveis à gentamicina.</p>', '<p>O Hi-Fatigue Bone Cement está indicado para a fixação de componentes de próteses de resina sintética e metálicas, na substituição parcial ou total da articulação coxofemoral, do joelho e de outras articulações, caso esteja comprovada ou se suspeite de uma infecção com germes sensíveis à gentamicina.</p>', 1, 0, '2024-06-18 16:23:17', NULL, NULL, 'imento-osseo--', 'imento-osseo.jpg', 'Catálogo', 'imento-osseo.pdf', '', NULL, '', NULL, NULL),
(10, 1, 43, 'Enxerto Col-Hap 91', 'Hidroxiapatita sintética absorvível. Material osteocondutor para enxerto ósseo.', 'ENXERTO COL HAP TIPO HAVIOLI', '1', '<p><strong>COL.HAP-91</strong>&nbsp;é um biomaterial composto de 25% de colágeno e 75% de&nbsp;<strong>HAP-91</strong>, de pureza comprovada, que associa as propriedades osteocondutoras da<strong>HAP-91</strong>&nbsp;às propriedades hemostáticas da malha de fibras de colágeno natural purificado, utilizado na sua elaboração.</p><p>O processo de obtenção mantém intacta a configuração helicoidal das moléculas de colágeno e o arranjo destas em camadas, o que garante a estrutura fibrosa natural, fundamental à preservação de suas propriedades hemostáticas.</p><p>Hidroxiapatita é o principal constituinte da fase mineral dos ossos, enquanto sua matriz orgânica é constituída basicamente por colágeno.&nbsp;<strong>COL.HAP-91</strong>, associação destes dois materiais, ambos biocompatíveis e absorvíveis, tem se mostrado muito eficiente na indução de crescimento ósseo entre os poros de sua estrutura física; o colágeno, além de coadjuvante no processo de hemostasia, atua como uma barreira biológica que impede o crescimento do tecido fibroso entre suas malhas e a migração do material implantado.</p><p>Fornecida sob forma de manta,&nbsp;<strong>COL.HAP-91</strong>&nbsp;é de fácil manuseio, podendo ser cortada ou moldada para preencher ou contornar o defeito ósseo.&nbsp;<strong>COL.HAP-91</strong>é produzida pela JHS Biomateriais. É apresentada em embalagens seladas contendo mantas de formatos e volumes médios diferentes, prontas para o uso em condições cirúrgicas, esterilizadas em óxido de etileno (ETO).</p><p> </p><p><strong>Características</strong></p><p>Um biomaterial composto de 25% de colágeno hemostático bovino e 75% de HAP-91, de pureza comprovada. A hidroxiapatita é o principal constituinte da fase mineral dos ossos, enquanto sua matriz orgânica é constituída basicamente por colágeno. Por esse motivo, a associação destes dois materiais na COL.HAP-91, ambos biocompatíveis e reabsorvíveis, tem se mostrado muito eficiente na condução de crescimento ósseo. A COL.HAP-91 é de fácil manuseio, podendo ser cortada ou moldada para preencher ou contornar o defeito ósseo.</p><ul><li>Característica de Osso Medular</li><li>Não apresenta rejeição do organismo</li><li>Aplicação direta no local</li><li>Dispensa o uso de PRP</li><li>Totalmente metabolizada</li></ul><p> </p><p><strong>Vantagens e Benefícios</strong></p><ul><li>25% de colágeno bovino e 75% de HAP-91;</li><li>Eficaz na condução de crescimento ósseo;</li><li>Fornecida em forma de manta, de fácil manuseio;</li><li>Pode ser cortada e/ou moldada.</li></ul>', '<p>A COL.HAP-91 é indicada em cirurgias médicas e odontológicas para recuperação, substituição parcial, preenchimento, reconstrução do tecido ósseo e hemostasia, devido a perdas por deformidades ósseas, exodontia, etc. Assim, tem aplicações e indicações nas áreas de cirurgia odontológica, ortopédica e traumatológicas, neurocirurgias, cirurgia de traumatologia buco-maxilofacial, cirurgias crânio-facial, cirurgia plástica reconstrutora e cirurgia de otorrinolaringologia.</p>', 1, 0, '2024-06-18 16:25:18', NULL, NULL, 'nxerto-ol-ap-91', 'nxerto-ol-ap-91.jpg', '', NULL, '', NULL, '', NULL, NULL),
(11, 1, 43, 'Equipo para Bomba de Irrigação RZ 2 vias', '', 'A DEFINIR', '1', '<p>Equipo para Bomba de Irrigação RZ 2 vias é&nbsp;utilizado em conjunto com a bomba de infusão em cirurgias artroscópicas e histeroscópicas para proporcionar a distensão e irrigação da articulação e a irrigação da cavidade uterina, objetivando visibilidade e facilidade na manipulação dos instrumentais.</p>', '', 1, 0, '2024-06-19 09:48:27', NULL, NULL, 'quipo-para-omba-de-rrigacao--2-vias', 'quipo-para-omba-de-rrigacao-2-vias.jpg', '', NULL, '', NULL, '', NULL, NULL),
(12, 1, 43, 'Kit Mosaicoplastia', 'Kit com trefina estéril e descartável', 'KIT COM TREFINA PARA MOSAICOPLASTIA', '1', '<p>O Kit reutilizável com Instrumental para Mosaicoplastia Implanfix tem como finalidade auxiliar o médico cirurgião na coleta osteocondral de “enxertos” autógenos do tecido ósseo com bastante cartilagem hialina saudável que possa ser transferida para a área defeituosa que necessita de transplante. Este “plug” osteocondral retirado do tecido é incorporado e ajustado em uma ou mais orifício, previamente medidos, no local do transplante. Os Instrumentais que compõem este Kit são fabricados basicamente em Aço Inoxidável, conforme Norma ASTM (American Society for Testing and Materials) SPECIFICATION FOR STAINLESS STEEL FOR SURGICAL INSTRUMENTS (Especificação Padrão para barras e arames de aço inoxidável para instrumentos cirúrgicos). O Kit com Instrumental para Mosaicoplastia Implanfix é fornecido na condição de produto não estéril, devendo ser esterilizado antes do seu uso. Recomenda-se Esterilizar por autoclavagem a vapor na instituição hospitalar.</p><p> </p><p>As Trefinas Implanfix têm como finalidade auxiliar o médico cirurgião na coleta osteocondral de “enxertos” autógenos do tecido ósseo com bastante cartilagem hialina saudável que possa ser transferida para a área defeituosa que necessita de transplante. As Trefinas Implanfix descartáveis para Mosaicoplastia Implanfix é fabricada basicamente em Aço Inoxidável, conforme Norma ASTM (American Society for Testing and Materials) SPECIFICATION FOR STAINLESS STEEL FOR SURGICAL INSTRUMENTS (Especificação Padrão para barras e arames de aço inoxidável para instrumentos cirúrgicos). As Trefinas Implanfix são fornecidas na condição estéril e de uso único.</p><p> </p><p>O Kit com Trefina para Mosaicoplastia Implanfix é indicado para cirurgias de transplante osteocondral através de enxertos cilíndricos nos respectivos tamanhos 6, 8 10 e 12 mm. É realizada a colheita de enxerto(s) de cartilagem na região hialina de um sitio doador superior e lateralmente ao nível ou acima do sulco terminal. Um enxerto destinatário, devidamente dimensionado para a profundidade adequada, é criado na lesão condral para receber o enxerto doador. O enxerto doador pode ser visualizado no momento do transplante por um tubo transparente. O enxerto doador por sua vez será introduzido através do Empurrador Externo com Rosca Implanfix (Instrumental Cirúrgico Reutilizável Implanfix). NOTA: Distribuidor – a utilização de instrumentais de diferentes fabricantes pode ocasionar alguns problemas técnicos, devido ao aspecto dimensional, desenho e quanto à compatibilidade de matéria prima, podendo causar desgastes e riscos desnecessários que podem vir a prejudicar o produto podendo proporcionar até uma fixação indesejada. Kit com Trefina para Mosaicoplastia Implanfix é fornecido embalado em blister interno e externo na condição estéril, contendo uma trefina receptora na cor AZUL, uma trefina doadora na cor CINZA e um tubo externo transparente.</p><p> </p>', '', 1, 2, '2024-06-19 09:56:20', '2024-06-19 10:16:29', '2024-06-19 10:16:32', 'it-osaicoplastia', 'it-osaicoplastia.jpg', 'Técnica Cirúrgica', 'it-osaicoplastia.pdf', '', NULL, '', NULL, NULL),
(13, 1, 43, 'Parafuso de Interferência Gentle Threads', 'Implante feito de LactoSorb®, um copolímero reabsorvível de poliéster derivado dos ácidos láctico e glicólico.', 'PARAFUSO DE INTERFERÊNCIA ABSORVÍVEL', '1', '<p>Os&nbsp;<strong>Parafusos de Interferência Gentle Threads&nbsp;</strong>são parafusos de fixação por interferência para uso em procedimentos de fixação de tecido mole. O implante é feito de LactoSorb®, um copolímero reabsorvível de poliéster derivado dos ácidos láctico e glicólico. O copolímero de ácido poliláctico/ poliglicólico se degrada e é reabsorvido in vivo por hidrólise sob a forma de ácidos láctico e glicólico, que são metabolizados pelo organismo. O Copolímero LactoSorb® é composto de 82% de ácido L-láctico (PLLA) e 18% de ácido glicólico (PGA). Esta formulação única incorpora as propriedades de alta resistência da PGA com as características de absorção intermediária do PLLA para formar um copolímero biocompatível reabsorvível que retém mais de 80% de sua resistência mecânica durante as primeiras oito semanas de cicatrização.</p>', '<p>• Reparação do ligamento oblíquo anterior (LCA);</p><p>• Reparação do ligamento oblíquo posterior (LCP);</p><p>• Reparação do ligamento colateral medial (LCM);</p><p>• Reparação do ligamento colateral lateral (LCL);</p><p>• Fechamento da cápsula articular;</p><p>• Avanço do músculo vasto medial oblíquo (VMO).</p>', 1, 0, '2024-06-19 10:18:58', NULL, NULL, 'arafuso-de-nterferencia-entle-hreads', 'arafuso-de-nterferencia-entle-hreads.jpg', 'Técnica Cirúrgica', 'arafuso-de-nterferencia-entle-hreads.pdf', 'Catálogo', 'arafuso-de-nterferencia-entle-hreads.pdf', '', NULL, NULL),
(14, 1, 43, 'Prótese Primária de Joelho Nexgen CR e LPS Flex', 'Um dos sistemas totais de joelho mais amplamente utilizados e clinicamente comprovados no mundo', 'PRÓTESE TOTAL DE JOELHO IMPORTADA', '1', '<p><strong>NEXGEN CR FLEX</strong></p><p> </p><p>A Prótese Total de Joelho NexGen® CR acomoda com segurança a flexão de até 155°, mantendo a</p><p>função cinemática que permite a &nbsp;olagem posterior femoral natural. Recursos específicos de design do joelho CR ajudam a manter o contato tibio-femoral a dequado durante a alta flexão e fornece maior folga para o tendão patelar. A opção de componentes femorais de tamanho Minus oferecem um meio adicional de equilibrar os espaços de flexão e extensão, sem perda óssea adicional nem liberação de tecido mole.</p><p> </p><p><strong>CRESCENTE DEMANDA POR ALTA FLEXÃO</strong></p><p>Projetar implantes de joelho para uma população de pacientes em mudança significa acomodar as oportunidades que o paciente traz para a mesa. Hoje, muitos pacientes têm a capacidade e o desejo de retomar as atividades de alta flexão após a TKA. O design de um implante de joelho deve aumentar, não inibir, essas oportunidades. Embora uma flexão elevada seja possível com implantes de retenção de cruzamento tradicionais, seu design pode não ser otimizado para uma flexão segura que exceda 120º. O Joelho NexGen® CR foi projetado para acomodar flexão até 155º para pacientes com habilidade e desejo para fazê-lo, mantendo a função cinemática que permite a reversão natural em uma prótese de joelho de retenção de cruzamento.</p><p> </p><p><strong>AS DEMANDAS ESPECÍFICAS DO CIRURGIÃO CR</strong></p><p>Especificamente projetado para o cirurgião CR, a Prótese Total de Joelho NexGen® CR é uma boa escolha para todos os pacientes CR porque oferece n ovos e lementos de design que abordam não apenas flexões elevadas, mas todas as questões importantes enfrentadas pelos cirurgiões CR. Considere o joelho apertado em flexão e aceitável em e xtensão. O CR oferece componentes femorais de tamanho negativo que são 2mm menores na dimensão A/P. Sem remover o osso adicional, as opções de tamanho negativo ajudam o cirurgião CR a equilibrar as lacunas de flexão e extensão.</p><p> </p><p><strong>NEXGEN LPS FLEX</strong></p><p> </p><p><strong>A ANATOMIA DA FLEXÃO</strong></p><p>A Prótese Total de Joelho NexGen® LPS é projetada para acomodar a retomada de atividades diárias com alta flexão. A atenção a seleção do paciente, técnica cirúrgica, ao tamanho do implante e a reabilitação pode ajudar a aumentar as chances de sucesso. A Prótese Total de Joelho NexGen® LPS pode ser usada com aumentos e extensões da haste. Muitas atividades da vida diária exigem flexão acima de 120°. Considere subir escadas (75°-140°), sentar-se em uma cadeira e levantar-se novamente (90°-130°), ou agachar (130°-150°). A Prótese Total de Joelho NexGen® LPS estende a solução para pacientes com capacidade de até 155° de flexão ativa. Côndilos posteriores estendidos no componente femoral facilitam o contato tíbio-femoral para suportar a alta flexão segura de 155°. A conformação da geometria do Componente Femoral Fixo do LPS com a sua superfície de articulação permite uma perda mínima de área de contato durante a alta flexão. O recorte patelar anterior profundo na superfície articular tibial ajuda a reduzir a tensão na patela e fornece mais folga para o mecanismo de extensão. Um mecanismo modificado de coluna estabilizado posterior aumenta a resistência a subluxação em ângulos de alta flexão. A superfície articular do mancal fixo combina com as placas base tibiais atuais do NexGen (disponíveis com extensões e aumentos tibiais) e usa o mesmo mecanismo de travamento entrelaçado de polietileno. projetada para acomodar a retomada de atividades diárias com alta flexão.</p><p> </p><p><strong>FORNECE UM ESPECTRO COMPLETO DE SOLUÇÕES NEXGEN</strong></p><p>O joelho LPS representa uma escolha nova e distinta da ampla seleção de Joelhos NexGen, que são compatíveis com os modelos CR ou PS para casos primários ou de revisão. O componente femoral LPS estende a pacientes capazes de até 155° de flexão ativa. Agora você tem a liberdade de selecionar a melhor c ombinação de componentes para um determinado paciente com base na avaliação pré-operatória e intra-operatória.</p><p> </p><p><strong>INDICAÇÕES</strong></p><p>A Prótese Total de Joelho NexGen® LPS é uma prótese com estabilização posterior, cimentada e indicada para pacientes com dor e incapacidade grave no joelho devido a osteoartrite, artrite traumática, necrose avascular femoral e deformidades moderadas do valgo, varo ou da flexão.</p>', '<p>Prótese Total de Joelho</p><p>Artroplastia de Joelho</p>', 1, 0, '2024-06-19 10:24:55', '2024-06-19 10:25:33', NULL, 'protese-primaria-de-joelho-nexgen-cr-e-lps-flex', 'protese-primaria-de-joelho-nexgen-cr-e-lps-flex.jpg', 'Técnica Cirúrgica CR Flex', 'protese-primaria-de-joelho-nexgen-cr-e-lps-flex.pdf', 'Técnica Cirúrgica LPS Flex', 'protese-primaria-de-joelho-nexgen-cr-e-lps-flex.pdf', '', NULL, NULL),
(15, 1, 43, 'Prótese De Joelho Unicompartimental Oxford®', 'Com mais de 35 anos de experiência clínica, o Oxford® Partial Knee é o mais utilizado sistema de joelho parcial comprovado no mundo.', 'PRÓTESE DE JOELHO UNICOMPORTAMENTAL', '1', '<p>O desempenho clínico a longo prazo da Oxford® é suportado por estudos clínicos mundiais, tendo resultados de sobrevivência comparáveis, a maior distância, do que as artroplastias totais do joelho mais competitivas. É a única substituição parcial do joelho que rivaliza com o resultado clínico das substituições totais do joelho. A Prótese de Joelho Unicompartimental Oxford® é a e volução natural da artroplastia de menisco original, utilizada pela primeira vez em 1976 ela continua a oferecer a vantagem de ter uma grande área de contato em toda a amplitude de movimento para gerar desgaste mínimo do polietileno. Se realizada no início do processo patológico, a operação pode desacelerar o avanço da artrite nos outros compartimentos do joelho e promover o alívio dos sintomas no longo prazo. O implante O xford® alcançou taxas de sobrevivência de 98% em 10 anos, com uma taxa média de desgaste de 0,03 mm por ano. Uma vantagem da artroplastia unicompartimental é poder ser realizada por meio de uma pequena incisão sem deslocar a patela, evitando afetar as reflexões sinoviais da bolsa suprapatelar. Isso pode reduzir a dor pós-operatória e possibilitar uma recuperação mais completa e rápida da flexão. Com o uso adequado da instrumentação de Prótese de Joelho Unicompartimental Oxford®, a operação pode ser realizada por meio de uma pequena incisão, com grande precisão.</p><p> </p><p><strong>TÉCNICA MINIMAMENTE INVASIVA</strong></p><p>Uma vantagem da artroplastia unicompartimental é poder ser realizada por meio de uma pequena incisão sem deslocar a patela, evitando afetar as reflexões sinoviais da bolsa suprapatelar. Isso pode reduzir a dor pós-operatória e possibilitar uma recuperação mais completa e rápida da flexão. Com o uso adequado da instrumentação de Prótese de Joelho Unicompartimental Oxford, a operação pode ser realizada por meio de uma pequena incisão, com grande precisão.</p><p> </p><p><a href=\"https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/oxford-partial-knee.html\">https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/oxford-partial-knee.html</a></p><p> </p>', '<p>Prótese Parcial de Joelho</p><p> </p>', 1, 1, '2024-06-19 10:28:35', NULL, '2024-06-19 10:29:21', 'protese-de-joelho-unicompartimental-oxfordr', 'protese-de-joelho-unicompartimental-oxfordr.jpg', 'Técnica Cirúrgica', 'protese-de-joelho-unicompartimental-oxfordr.pdf', 'Catálogo', 'protese-de-joelho-unicompartimental-oxfordr.pdf', 'Vídeo', 'protese-de-joelho-unicompartimental-oxfordr.mp4', NULL),
(16, 1, 43, 'Prótese de Revisão de Joelho NexGen® Legacy® Constrained Condylar Knee (LCCK)', 'NexGen LCCK pode ser usado com aumentos, extensões de haste e cones de metal trabecular para ajudar a fornecer estabilização na artroplastia do joelho', 'PRÓTESE DE REVISÃO DE JOELHO LCCK', '1', '<p>NexGen LCCK destina-se a pacientes que, na opinião do cirurgião, necessitam de estabilização protésica adicional devido a função mediolateral, anteroposterior e do ligamento varo/valgo inadequada e necessitam de aumento e/ou extensões da haste devido a reserva óssea inadequada. Para utilização quando são excisados ligamentos cruzados e quando é necessária uma maior contração varo/ valgo (é possível utilizar um componente femoral LCCK com a superfície articular NexGen LPS, no entanto é fornecida uma menor contração varo/valgo). O NexGen LCCK pode ser utilizado com os aumentos e as extensões de hastes.</p><p> </p><p><strong>LIMITAÇÃO PROSTÉSICA</strong>: Para pacientes com falta de ligamentos colaterais funcionais ou cujos joelhos não podem ser estabilizados pelas libertações normais de tecidos, o LCCK apresenta uma espinha tibial elevada e um compartimento inter condiliano femoral mais profundo. Um encaixe próximo entre a espinha e o compartimento proporciona estabilidade à medida que o enrolamento mecânico é induzido, inibindo uma subluxação posterior e limitando o movimento varo/valgo a +1,25º e a rotação interna/externa a +2º. Este desenho permite uma amplitude de movimento teórica superior a 120º.</p><p> </p><p><strong>SISTEMA NEXGEN® LCCK</strong>&nbsp;Fornecendo soluções abrangentes com a tecnologia Metal Tântalo Trabecular™. Agora com nova instrumentação de revisão 4 em 1, o sistema Zimmer NexGen® LCCK fornece soluções para casos primários e de revisão, em que é necessária uma maior restrição varus / valgus ou que exigem o uso de aumentos ou hastes para fixação. Sua história está bem documentada com um design que remonta a 25 anos e uma sobrevivência reportada de 96% em 10 anos quando usada para revisão TKA. Com base nessa história clínica, Tecnologia Metal Tântalo Trabecular nos cones e aumento tibial e femoral abordam defeitos múltiplos e casos de revisão difíceis.</p><p> </p><p><a href=\"https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/nexgen-legacy-constrained-condylar-knee-lcck.html\">https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/nexgen-legacy-constrained-condylar-knee-lcck.html</a></p><p> </p>', '<p>Este dispositivo é indicado para pacientes com dor e incapacidade grave do joelho devido a:</p><p>• Artrite reumatoide, osteoartrite, artrite traumática, poliartrite;</p><p>• Distúrbios do colágeno e/ou necrose avascular do côndilo femoral;</p><p>• Perda pós-traumática da configuração da articulação, especialmente quando ocorre erosão ou disfunção femoropatelar ou patelectomia anterior;</p><p>• Deformidades moderada do valgo, varo ou da flexão;</p><p>• O resgate de tentativas cirúrgicas anteriores falhadas ou de um joelho no qual não é possível obter uma estabilidade satisfatória em flexão no momento da cirurgia;</p><p>• Os componentes do prato tibial e femoral com revestimento poroso CR e LPS podem ser utilizados</p><p>com ou sem cimento (fixação biológica);</p><p>• Os componentes do prato tibial e femoral com revestimento de hidroxiapatita/fosfato tricálcico [HA/TCP] CR só podem ser utilizados sem cimento. Todos os outros componentes do prato tibial e femoral e de rótula totalmente em polietileno são indicados apenas para utilização com cimento</p>', 1, 1, '2024-06-19 10:31:28', NULL, '2024-06-19 10:31:39', 'protese-de-revisao-de-joelho-nexgenr-legacyr-constrained-condylar-knee-lcck', 'protese-de-revisao-de-joelho-nexgenr-legacyr-constrained-condylar-knee-lcck.jpg', 'Técnica Cirúrgica', 'protese-de-revisao-de-joelho-nexgenr-legacyr-constrained-condylar-knee-lcck.pdf', '', NULL, '', NULL, NULL),
(17, 1, 43, 'Gender Solutions - Sistema da Articulação Patelo-Femoral', 'O Gender Solutions PFJ System foi projetado para abordar as diferenças anatômicas entre homens e mulheres com uma plataforma de instrumentação reproduzível, com o objetivo de simplificar a artroplastia patelo-femoral (PFA).', 'PRÓTESE FEMURO PATELAR', '1', '<p>A Prótese (PFJ) destina-se à substituição da tróclea femoral da articulação patelofemoral que foi acometida pelo processo patológico e/ou lesão. A prótese PFJ pode ser usada sozinha ou com o Zimmer Unicompartmental Knee System ou M/G® Unicompartmental Knee System para tratar condições das regiões patelofemoral ou tibiofemoral do joelho. A prótese PFJ é compatível com uma patela não revestida, uma NexGen® totalmente em polietileno, patela porosa ou de aumento ou uma patela Gender Solutions Natural-Knee® Flex totalmente em polietileno ou patela com suporte de metal. As próteses PFJ são fabricadas em liga de Cobalto-Cromo-Molibdênio e utilizam pré-revestimento de Polimetilmetacrilato (PMMA).</p><p> </p><p><strong>Flange anterior modificado e mais fino</strong></p><p>Um flange anterior mais fino ajuda a evitar o excesso de enchimento e foi projetado para atender à necessidade exclusiva da população feminina de alturas de côndilo medial e lateral mais curtas em comparação com os homens.</p><p> </p><p><strong>Aumento do Ângulo do Sulco Troclear</strong></p><p>Esse ângulo de rastreamento aprimorado provou ser particularmente útil em pacientes do sexo feminino, que representam aproximadamente dois terços dos receptores de PFA e que geralmente apresentam aumento do ângulo Q, displasia e subluxação patelar no pré-operatório.</p><p> </p><p><strong>&nbsp;Sistema de Fresamento Guiado Proprietário</strong></p><p>Um instrumento simples, eliminando os desafios e erros apresentados nas técnicas à mão livre.5 Ao fazer referência à cartilagem nativa para determinar a colocação em varo/valgo, a região intercondilar do implante é nivelada com a cartilagem circundante para ajudar a evitar o impacto do componente patelar.</p><p> </p><p><strong>&nbsp;Patela Compatível</strong></p><p>A prótese PFJ é compatível com Gender Solutions Natural-Knee®Flex e NexGen®Standard totalmente em polietileno, porosa ou patela de aumento.</p>', '<p>• Osteoartrite, artrite traumática, poliartrite e/ou condrocalcinose grave da articulação patelofemoral</p><p>• O resgate de tentativas cirúrgicas falhadas anteriormente (por exemplo, artroscopia, liberação lateral, transplante de cartilagem)</p><p>• História de luxação patelar ou fratura da patela</p><p>• Degeneração patelofemoral induzida por displasia</p><p>Este dispositivo destina-se apenas para uso cimentado.</p>', 1, 0, '2024-06-19 10:33:54', NULL, NULL, 'gender-solutions-sistema-da-articulacao-patelo-femoral', 'gender-solutions-sistema-da-articulacao-patelo-femoral.jpg', 'Catálogo', 'gender-solutions-sistema-da-articulacao-patelo-femoral.pdf', 'Técnica Cirúrgica', 'gender-solutions-sistema-da-articulacao-patelo-femoral.pdf', '', NULL, NULL);
INSERT INTO `produtos` (`id`, `usuario_id`, `categoria_id`, `titulo`, `sub_titulo`, `forma_convenio`, `ordenacao`, `texto`, `indicacoes`, `status`, `visitas`, `cadastrado_em`, `atualizado_em`, `ultima_visita_em`, `slug`, `capa`, `texto_botao_1`, `capa_botao_1`, `texto_botao_2`, `capa_botao_2`, `texto_botao_3`, `capa_botao_3`, `video`) VALUES
(18, 1, 43, 'Prótese de Revisão NexGen® Rotating Hinge', 'The Next Generation of Rotating Hinge Knees', 'Prótese de Joelho Hinge Rotacional', '1', '<p><strong>QUE É O JOELHO EM DOBRADIÇA NEXGEN HINGERO</strong></p><p>A Prótese de Revisão NexGen® Rotating Hinge&nbsp;apresenta um mecanismo de dobradiça modular que faz com que 95% da carga sobre os côndilos tibiais seja semelhante ao padrão de carga de um projeto de implante primário. Como os côndilos femorais se mantêm centrados na tíbia durante a amplitude do movimento e o formato do sulco rotuliano é semelhante ao desenho do sistema NexGen, o percurso da rótula é semelhante a uma prótese de joelho primário. Nos procedimentos de artroplastia mais complicados, é possível utilizar a prótese NexGen Hinger em combinação com os Cones tibiais e femorais Metal Tântalo® Trabecular que abordam os casos mais difíceis de perda óssea. Devido ao joelho NexGen Hinger ter desenho modular utilizando os aumentos NexGen, os cortes ósseos básicos são idênticos aos efetuados para os componentes do sistema primário, isto ajuda a minimizar a perda óssea e permite a utilização da mesma instrumentação em procedimentos de implantes primários.</p><p> </p><p><strong>FUNÇÃO DA DOBRADIÇA COM DESIGN INOVADOR</strong></p><p>A prótese NexGen Hinger foi projetada para abordar os principais problemas que se relacionam com muitos projetos convencionais de joelho giratório.</p><p> </p><p><strong>CENTRO E ROTAÇÃO</strong></p><p>A localização central do mecanismo da dobradiça do joelho NexGen Hinger está mais próxima do eixo do componente tibial, resultando numa cinemática fêmur-tibial mais natural e estável em comparação com os desenhos anteriores de joelho de dobradiça. A rotação da plataforma do joelho NexGen Hinger foi concebida para deslocar as cargas de torção das interfaces de cimento para os tecidos moles, já que permite até25º de movimento em rotação interna e externa.</p><p> </p><p><strong>MODULARIDADE DO MECANISMO DE PINO/BLOQUEIO DA DOBRADIÇA</strong></p><p>A modularidade do pino de extensão da dobradiça permite que a implantação prossiga sem necessitar que o joelho seja demasiado manipulado enquanto os componentes são montados. Os componentes femorais e tibiais do joelho NexGen Hinger são colocados na sua posição com cimento e, com um desvio mínimo, a superfície articular tibial roda até à sua posição. A extensão da dobradiça é facilmente inserida no prato tibial e apertada.</p><p> </p><p><strong>95% DE CARGA CONDILAR</strong></p><p>Em muitos desenhos de joelho de dobradiça rotativos convencionais, a dobradiça suporta a maioria da carga compressiva até ser atingida a extensão total. Os desenhos cujo centro de rotação está situado posteriormente podem causar um efeito de alavanca na articulação, o que se traduz em tensão exercida sobre as interfaces de cimento ou um desgaste acelerado do suporte de polietileno na dobradiça. O joelho NexGen Hinger aborda estas questões, já que o componente femoral Hinger e as superfícies articulares são concebidos para manter um contato centralizado durante a amplitude de movimentos (de -3° de hiper extensão até 120°). O desenho patenteado da dobradiça permite passar 95% da carga através dos côndilos tibiais.</p><p> </p><p><strong>PRINCIPAIS CONCEITOS E VANTAGENSCINEMÁTICA FÊMUR-RÓTULA</strong></p><p>O componente femoral de joelho NexGen Hinger tem o mesmo desenho femoro-rotuliano do que outros componentes femorais NexGen. O sulco permite que a rótula faça um percurso profundo, tal como uma rótula anatômica. A rótula está totalmente suportada nas flexões até 60°. A localização central do eixo da dobradiça mantém os côndilos femorais num plano sagital estável. Isto permite um percurso da rótula mais normal, pois a rótula não se desloca posteriormente durante a flexão.</p><p> </p><p><strong>CONCEBIDO PARA LIMITAR O IMPACTO E RESISTIRÀ LUXAÇÃO</strong></p><p>• Para resistir à luxação, o desenho do mecanismo de bloqueio do Joelho NexGen Hinger oferece uma “altura de salto” de 40 mm.</p><p>• A relação de conformidade entre os côndilos femorais e a superfície articular tibial altamente côncava é praticamente de 1 para 1. Maximizando a área de contato, as tensões no polietileno são distribuídas por uma superfície maior.</p><p>• O contato ocorre no raio frontal do componente femoral de joelho NexGen Hinger com a superfície articular mesmo quando os implantes e move para a hiperextensão. Desta forma, o joelho desvia-se ligeiramente e amortece o impacto da extensão. Esta interação foi concebida para dissipar a força de hiperextensão.</p><p> </p><p><a href=\"https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/nexgen-rotating-hinge-knee.html\">https://www.zimmerbiomet.com/en/products-and-solutions/specialties/knee/nexgen-rotating-hinge-knee.html</a></p>', '<p>Este dispositivo é indicado para pacientes com instabilidade de joelho moderada a severa, perda óssea significativa e/ou deficiências de ligamento causadas por neoplasmas, traumatismo, artrite reumatoide, osteoartrite, artrite traumática, poliartrite, desordens de colágeno e/ou necrose avascular do côndilo femoral, deformidades de valgus, varus ou flexão, e para salvamento de tentativas cirúrgicas anteriores fracassadas. Este dispositivo é voltado para uso apenas com cimento.</p>', 1, 0, '2024-06-19 10:36:41', NULL, NULL, 'protese-de-revisao-nexgenr-rotating-hinge', 'protese-de-revisao-nexgenr-rotating-hinge.jpg', 'Técnica Cirúrgica', 'protese-de-revisao-nexgenr-rotating-hinge.pdf', 'Catálogo', 'protese-de-revisao-nexgenr-rotating-hinge.pdf', '', NULL, NULL),
(19, 1, 43, 'Sutura Cirúrgica Agulhada Suturfix', '', 'Sutura Cirúrgica Agulhada Suturfix', '1', '<p>Os modelos comerciais que compõem a família da Sutura cirúrgica agulhada Suturfix são classificados como produto médico implantável invasivo cirurgicamente de uso em longo prazo. O fio da sutura cirúrgica é de origem sintética, fabricada com multifilamento trançado de Polietileno de Ultra Alto Peso Molecular (UHMWPE) de alta resistência, não absorvível e com agulha, estéril. Possui número cirúrgico 2 e 2-0 (número métrico 5 e 3, respectivamente) e vários comprimentos: 45 cm, 75 cm e 90 cm; atende aos requisitos USP (United States Pharmacopeia) e NBR 13904. A agulha curva é fabricada com Aço Inoxidável XM-16, atraumática, furada, curva, cilíndrica, ½ círculo, com 20 e 25 mm de comprimento. A agulha reta é fabricada com Aço Inoxidável F138, atraumática, furada, reta, cilíndrica, com 255 mm de comprimento. Atendem aos requisitos da norma NBR 13911 e ASTM F138.</p><p><a href=\"https://sartori.ind.br/perfil-produto/sutura-cirurgica-agulhada-suturfix/15\">https://sartori.ind.br/perfil-produto/sutura-cirurgica-agulhada-suturfix/15</a></p>', '<p>Os fios de sutura com agulha curva são indicados para aproximação e/ou ligação das partes moles, e os fios de sutura com agulha reta são indicados para reparo de menisco.</p><p> </p>', 1, 1, '2024-06-19 10:38:09', NULL, '2024-06-19 10:38:15', 'sutura-cirurgica-agulhada-suturfix', 'sutura-cirurgica-agulhada-suturfix.jpg', '', NULL, '', NULL, '', NULL, NULL),
(20, 1, 43, 'Lâminas de Shaver', 'Debridação de tecidos inflamatórios, fibroses, restos ligamentares e desbastes ósseos.', 'Lâminas de Shaver', '1', '<p>As&nbsp;Lâminas de Shaver possem a função de realizar a microdebridação de tecidos moles, cartilaginosos e ósseos em procedimentos cirúrgicos artroscópicos.</p>', '', 1, 0, '2024-06-19 10:39:55', NULL, NULL, 'laminas-de-shaver', 'laminas-de-shaver.jpg', '', NULL, '', NULL, '', NULL, NULL),
(21, 1, 43, 'Parafuso De Interferência em Titânio', 'Os parafusos de interferência possuem o mais alto padrão de qualidade e a família mais completa.', 'PARAFUSO DE INTERFERÊNCIA TITÂNIO', '1', '<p>O PARAFUSO DE INTERFERÊNCIA é um dispositivo médico implantável, não ativo, invasivo cirurgicamente, de uso único, que se caracteriza como uma família de parafusos implantáveis. Todos os modelos comerciais do Parafuso de Interferência são de uso único e não podem ser reutilizados. O Parafuso de Interferência apresenta-se em diversas dimensões que permitem ao profissional escolher o modelo mais adequado a cada situação.</p><ul><li>Fabricados em Titânio.</li><li>Fácil introdução.</li><li>Não cortante.</li><li>Diâmetros para cirurgia de revisão.</li></ul>', '<p>Fixação Tibial e Femoral de tecido mole ou enxertos osso-tendão em reconstruções de ligamentar.</p><p>O Parafuso de Interferência Estéril é indicado para cirurgias ortopédicas para reconstrução dos ligamentos, visando o restabelecimento da biomecânica articular do joelho e tem como finalidade fornecer meios de fixação no túnel ósseo do fêmur do osso em procedimentos convencional ou artroscópica em cirurgias de reconstrução do Ligamento.</p>', 1, 0, '2024-06-19 10:41:10', NULL, NULL, 'parafuso-de-interferencia-em-titanio', 'parafuso-de-interferencia-em-titanio.jpg', '', NULL, '', NULL, '', NULL, NULL),
(22, 1, 43, 'Placa Endobutton', 'A placa Endobutton é um dispositivo médico utilizado em cirurgias ortopédicas, especialmente em procedimentos de reconstrução de ligamentos, como no caso do ligamento cruzado anterior (LCA) no joelho.', 'Placa Endobutton', '1', '<p>A placa Endobutton é frequentemente utilizada em conjunto com enxertos de tendões, como o tendão patelar ou o tendão isquiotibial, para substituir ou reparar ligamentos danificados.</p><p>O dispositivo é projetado para fixar o enxerto de tendão no osso de forma segura, permitindo a cicatrização e a regeneração dos tecidos. A placa Endobutton consiste em uma placa de metal ou plástico que é inserida no osso, geralmente no fêmur, com parafusos. Um botão (daí o nome \"Endobutton\") é conectado ao enxerto de tendão e fixado à placa, permitindo que o enxerto seja ancorado firmemente ao osso.</p><p>O design da placa Endobutton e o processo cirúrgico podem variar dependendo do fabricante e da técnica cirúrgica específica utilizada pelo cirurgião. Essa abordagem é uma alternativa ao uso de pinos ou outras técnicas para fixação de enxertos em cirurgias de reconstrução ligamentar.</p><p>•Fabricados em Titânio.</p><p>•Proporciona estabilização nos movimentos de extensão, flexão e rotação dos joelhos.</p><p>•Maior segurança ao paciente.</p><p>•Placas em Diversos Tamanhos.</p>', '<p>Reconstruções de ligamento do Joelho.</p>', 1, 0, '2024-06-19 10:43:17', NULL, NULL, 'placa-endobutton', 'placa-endobutton.jpg', '', NULL, '', NULL, '', NULL, NULL),
(23, 1, 43, 'Radio Frequência Bipolar', 'A unidade RF opera usando um fluxo de corrente de alta frequência. A unidade destina-se ao corte, vaporização e coagulação em procedimentos artroscópicos. Também pode ser usado em pequenos procedimentos cirúrgicos abertos.', 'Radio Frequência Bipolar', '1', '<p>A unidade eletrocirúrgica Zimmer Biomet RF opera usando um fluxo de corrente de alta frequência. A unidade destina-se ao corte, vaporização e coagulação em procedimentos artroscópicos.</p><p> </p><p><strong>Características principais</strong></p><p>• Sistema Plug &amp; Play com reconhecimento automatizado de instrumentos</p><p>• Pré-configurações de fábrica específicas do instrumento</p><p>• Sistema automático de regulação de potência projetado para minimizar a transferência de energia para a junta</p><p>• Detecção do osciloscópio projetada para reduzir o risco de danos ao osciloscópio pelo usuário</p><p>• Sistema de autodiagnóstico com feedback amigável</p><p>• Tela TFT de 7” com painel sensível ao toque</p><p>• Pedal opcional com funções estendidas</p><p>• Frequência operacional – 333kHz</p><p>• CORTE Bipolar – máx. 250W, 9 efeitos disponíveis</p><p> </p><p><strong>Eletrodos Bipolares Descartáveis</strong></p><p>Os eletrodos bipolares descartáveis Zimmer Biomet são projetados para corte, vaporização, coagulação e modificação térmica de tecidos moles. O produto é de uso único e totalmente descartável. A alça apresenta design ergonômico e está disponível em duas versões, para controle manual e para controle com o pé em combinação com o pedal RF. O design do botão e do interruptor segue o mesmo conceito em ambos os tipos de eletrodos, apresentando um botão multiinterruptor com funcionalidade estendida.</p>', '', 1, 0, '2024-06-19 10:45:36', NULL, NULL, 'radio-frequencia-bipolar', 'radio-frequencia-bipolar.jpg', 'Catálogo', 'radio-frequencia-bipolar.pdf', '', NULL, '', NULL, NULL),
(24, 1, 43, 'Sutura de Menisco JuggerStitch™', 'All-inside, All-suture, Knotless', 'Kit Para Sutura de Menisco JuggerStitch', '1', '<p><strong><em>All-inside, All-suture, Knotless</em></strong></p><p>Para continuar o legado de inovação utilizando tecnologia de âncora suave em todo o corpo, a equipe de desenvolvimento da Zimmer Biomet Sports Medicine projetou o dispositivo meniscal&nbsp;<em>JuggerStitch</em>™. Um implante meniscal&nbsp;<em>All-inside, All-suture, Knotless,</em>&nbsp;o sistema de aplicação do dispositivo&nbsp;<em>JuggerStitch™</em>&nbsp;é ergonomicamente projetado para permitir facilmente a inserção do implante.</p><p> </p><p><strong>Vantagens</strong></p><p>Mecanismo de entrega ergonômico;</p><p>Permite a implantação rápida e simples do implante;</p><p> </p><p><strong>Agulha de ponta cônica de baixo perfil</strong></p><p>Destinado a minimizar o corte do tecido meniscal durante a inserção;</p><p> </p><p><strong><em>All-suture, Knotless</em></strong></p><p>Permite tensionamento controlado, eliminando âncoras plásticas rígidas e nós duros na superfície meniscal;</p>', '', 1, 0, '2024-06-19 10:47:47', NULL, NULL, 'sutura-de-menisco-juggerstitchtm', 'sutura-de-menisco-juggerstitchtm.jpg', 'Técnica Cirúrgica', 'sutura-de-menisco-juggerstitchtm.pdf', 'Artigo', 'sutura-de-menisco-juggerstitchtm.pdf', 'Flyer', 'sutura-de-menisco-juggerstitchtm.pdf', NULL),
(25, 1, 43, 'Dispositivo ToggleLoc™ com tecnologia ZipLoop®', 'Para reconstrução do LCA', 'Dispositivo ToggleLoc', '1', '<p>O dispositivo ToggleLoc com tecnologia ZipLoop para reconstrução do LCA foi projetado para uso tanto no portal transtibial quanto no portal anteromedial, e a tensão pode ser aplicada do lado femoral após a fixação tibial ter sido alcançada. Este dispositivo sem nós também permite uma alteração no comprimento do seu laço para que ele caiba em praticamente qualquer comprimento de túnel.</p><p> </p><p>Benefícios:</p><ul><li><p>Implante de tamanho único que se adapta a todos os comprimentos de túnel femoral;</p></li><li><p>Permite a capacidade de retensionar do lado femoral após a fixação tibial;</p></li><li><p>Fornece instruções de compactação padrão ou retro (ZipLoop Inline) e opções de resgate (botão XL);</p></li></ul>', '', 1, 0, '2024-06-19 10:49:23', NULL, NULL, 'dispositivo-toggleloctm-com-tecnologia-ziploopr', 'dispositivo-toggleloctm-com-tecnologia-ziploopr.jpg', '', NULL, '', NULL, '', NULL, NULL),
(26, 1, 43, 'Aumentos em Metal Tântalo Trabecular™ para Revisão de Joelho', 'The Best Thing Next to Bone ', 'Aumento Para Prótese Revisão De Joelho Em Trabecular Metal', '1', '<p>Os Aumentos Trabeculares oferecem uma ótima combinação de materiais e design. Fornecem um suporte estrutural na área de perda de massa óssea e oferece uma alternativa a procedimentos de enxerto. Este produto tem uma elasticidade semelhante ao osso, com uma porosidade média de até 80%. Seus poros totalmente interligados permitem vias desimpedidas para o crescimento ósseo, e sua estrutura celular se assemelha osso. Estes componentes são para uso apenas com os Sistemas de Joelho NexGen. Quando usado com o Sistema LCCK, os aumentos são para uso cimentado ou não cimentado. Quando usado com o Sistema de Joelho RH, são apenas para uso cimentado.</p><p> </p><p><strong>The Best Thing Next to Bone</strong></p><p>A Tecnologia Metal Tântalo Trabecular™ é uma superfície de fixação avançada projetada para implantes ortopédicos. Com um alto coeficiente de fricção (0,98), ele fornece um excelente encaixe por atrito inicial. Diferentemente de revestimentos e outras superfícies, o Metal Tântalo Trabecular™ tem porosidade de até 80%, aumentando o potencial de incorporação óssea e vascularização do tecido mole. Com sua arquitetura de estrutura nanotexturizada, o Metal Tântalo Trabecular™ é similar ao osso canceloso em estrutura, função e fisiologia.</p><p> </p><p><strong>Estrutura</strong></p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Porosidade de até 80%;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tamanho de poros consistente e poros 100% interconectados facilita, a incorporação biológica;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A combinação de resistência e elasticidade do Tântalo elementar;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tamanho médio de poro de 44µm;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Baixo módulo de elasticidade;</p><p> </p><p><strong>Função</strong></p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Alto coeficiente de fricção para maior estabilidade;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Baixo módulo de elasticidade similar a osso canceloso para carregamento fisiológico mais normal que tem o potencial de reduzir a remodelação óssea;</p><p> </p><p><strong>Fisiologia</strong></p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; O Tântalo elementar é quimicamente estável e biologicamente inerte;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A estrutura suporta integração do osso, remodelação do osso e vascularização;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Estrutura de superfície nanotexturizada;</p><p> </p><p>O Metal Tântalo Trabecular™ é amplamente usado no portfólio de produtos da Zimmer, incluindo implantes de quadril, joelho e ombro, aplicações de traumatologia, implantes de coluna, preenchimento de Iacunas ósseas e aumentos, parafusos AVN e implantes dentários.</p><p> </p><p><strong>Material</strong></p><p>O material Metal Tântalo Trabecular™ é feito de Tântalo elementar (peso atômico 73), um dos metais mais estáveis quimicamente e inertes fisiologicamente usados em implantes ortopédicos, o que o torna altamente biocompatível e resistente a corrosão. O Tântalo é o material ideal para essa estrutura de incorporação porque tem resistência a fadiga e um módulo compressivo que permite que ele flexione antes de quebrar. O Metal Tântalo Trabecular™ é produzido em uma instalação dedicada em Parsippany, Nova Jersey. Utilizando um processo exclusivo de deposição térmica, o Tântalo é depositado em um substrato, criando uma topografia de superfície nanotexturizada e construindo o Metal Tântalo Trabecular™ um átomo de cada vez.</p><p> </p><p><strong>Clínica</strong></p><p>A tecnologia Metal Tântalo Trabecular™ da Zimmer tem mais de 15 anos de histórico clínico, e o desempenho de componentes específicos em pacientes humanos foi bem documentado em mais de 250 artigos e abstracts revistos por pares. Estudos independentes confirmaram as propriedades estruturais e mecânicas do material Metal Tântalo Trabecular™.</p>', '<p>Prótese de Revisão de Joelho</p><p> </p>', 1, 0, '2024-06-19 10:51:25', NULL, NULL, 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-joelho', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-joelho.jpg', 'Técnica Cirúrgica Cone Femoral', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-joelho.pdf', 'Técnica Cirúrgica Cone Tibial', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-joelho.pdf', 'Catálogo', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-joelho.pdf', NULL),
(27, 1, 43, 'Endopróteses Modulares Fabroni', 'Produto fabricado em metal e polietileno, desenvolvido para substituição de membros afetados ou que perderam seu funcionamento normal. São fabricados conforme a anatomia do segmento ósseo a ser substituído, que pode ser substituição total ou parcial do me', 'Endopróteses Modulares', '1', '<p>Produto fabricado em metal e polietileno, desenvolvido para substituição de membros afetados ou que perderam seu funcionamento normal. São fabricados conforme a anatomia do segmento ósseo a ser substituído, que pode ser substituição total ou parcial do membro, conforme a necessidade do paciente.</p><p>É constituída por uma parte em polietileno que se assemelha a forma do seguimento ósseo a ser substituído, e por uma parte metálica que tem a dupla função de reforçar o corpo de polietileno e fixar a prótese na cavidade medular do segmento ósseo. Quando a substituição é parcial de um osso a fixação é endomedular com utilização de cimento acrílico. Quando a substituição é total a adaptação será nos componentes articulares os quais deverão ser fixados nos ossos adjacentes com utilização de cimento acrílico.</p><p>Assim para cada tipo de endoprótese será apresentado um conjunto de componentes que serão descritos com sua função.</p><p>São fabricadas em Aço Inoxidável, liga de Cromo cobalto, liga de Titânio e polietileno. Os materiais utilizados são normalizados e compatíveis excluindo qualquer contra indicação de serem utilizados em conjunto com outros materiais e no tecido humano.</p>', '<p>A DEFINIR</p>', 1, 0, '2024-06-19 10:53:47', NULL, NULL, 'endoproteses-modulares-fabroni', 'endoproteses-modulares-fabroni.jpg', 'Informativo', 'endoproteses-modulares-fabroni.pdf', 'Vídeo', 'endoproteses-modulares-fabroni.mp4', '', NULL, NULL),
(28, 1, 45, 'Mini Expert – Fixador de Articulação', 'Sistema de fixação flexível para a articulação das extremidades: pé, mão e punho', '', '1', '<p>O Mini Expert foi desenvolvido para o tratamento de lesões ligamentares através de fixação flexível de articulações das extremidades: pé, mão e punho.</p><ul><li><p>Variedade de indicações para procedimentos minimamente invasivos;</p></li><li><p>Fios e malha de alta resistência fabricados em UHMWPE (polietileno de ultra alto peso molecular), trançados e não absorvíveis;</p></li><li><p>Matéria-prima: Titânio 6Al4V conforme norma ASTM F 136;</p></li></ul>', '<ul><li><p>Pé: fixação flexível de lesão da Lisfranc, correção do&nbsp;<em>“hallux varus”&nbsp;</em>e&nbsp;<em>“hallux valgus”</em>;</p></li><li><p>Mão: suspensoplastia em procedimentos de trapezectomia ou hemi-trapezectomia no tratamento da rizartrose;</p></li><li><p>Punho: fixação flexível da articulação radioulnar distal nas lesões traumáticas instáveis do punho, e lesões da membrana interóssea - Essex Lopresti;</p></li><li><p>Estabilização da Articulação Radioulnar Distal (ARUJ) no tratamento das lesões instáveis da membrana interóssea.</p></li><li><p>Possibilidade de uso conjunto do Mini Expert com as âncoras Fastlock para fixação com perfil zero (sem nós) evitando desconforto do paciente.</p></li></ul>', 1, 0, '2024-06-19 10:55:35', NULL, NULL, 'mini-expert-fixador-de-articulacao', 'mini-expert-fixador-de-articulacao.jpg', 'Catálogo', 'mini-expert-fixador-de-articulacao.pdf', '', NULL, '', NULL, NULL),
(29, 1, 35, 'Sistema de Prótese de Ombro Comprehensive', 'O design do Comprehensive Total Shoulder System é baseado na herança clínica bem-sucedida do Bio-Modular® Shoulder System.', 'PRÓTESE DE OMBRO COMPREHENSIVE ANATÔMICA ou REVERSA', '1', '<p>A Prótese de Ombro Comprehensive® é indicada para artroplastia total de ombro e sua família possui diversas soluções, tais como: Comprehensive Anatômica e Comprehensive Reversa. O sistema Comprehensive é considerado o sistema mais moderno de ombro e apresenta avanços e características únicas. Atualmente é líder do mercado mundial e possui a maior número de estudos e follow up se comparado aos seus concorrentes. Três mensagens devem ficar gravadas em nossa mente e dos cirurgiões com relação a Comprehensive:</p><p>• Líder do Mercado mundial;<br />• Único com hastes curtas;<br />• Implantes e instrumentação simples.</p><p> </p><p><strong>Maior preservação Óssea</strong><br />• Hastes Standard, Mini e Micro<br />• Base reversa de 25mm</p><p> </p><p><strong>Minimização do “Notching”</strong><br />• O “Offset” da glenosfera permite uma translação inferior<br />• Ângulo umeral de 147º comparado a 155º das próteses de 1ª geração</p><p> </p><p><strong>Técnica simplificada</strong><br />• Toda Instrumentação glenoidal através de um único pino canulado para configurações anatômica e reversa<br />• Permite conversão de prótese anatômica para prótese reversa</p><p> </p><p><strong>Principais vantagens do Comprehensive:</strong></p><p>• Maior disponibilidade de tamanhos das hastes umerais, tendo tamanhos menores que nenhuma outra empresa possui, reduzindo perda óssea e tempo cirúrgico;<br />• Pode ser usado com ou sem cimentado;<br />• As mesas hastes são utilizadas para anatômica e reversa, podendo ser convertido facilmente em caso de evolução;<br />• A combinação da tecnologia de offset variável Versa-Dial e múltiplos tamanhos de glenosfera permitem um deslocamento infinito com centro medializado ou lateralizado de rotação. Não há um buraco na superfície de articulação, e as glenosferas podem ser posicionadas em qualquer orientação;<br />• Instrumental simples e fácil de ser utilizado;<br />• Maior evidência clínica.</p><p> </p><p><strong>Detalhes técnicos:&nbsp;</strong></p><p>O sistema Comprehensive anatômico é formado por uma haste umeral, um adaptador para cabeça umeral, cabeça umeral, base da glenóide e parafuso de fixação glenoidal.<br />O sistema Comprehensive reverso é formado por uma haste umeral, uma bandeja umeral, um inserto umeral, uma cabeça invertida, um adaptado para cabeça umeral, uma base para glenóide, 4 parafusos laterais e um parafuso central.</p><p> </p><p> </p><p> </p>', '<p>Prótese Total de Ombro Reversa<br />Prótese Total de Ombro Anatômica</p><p> </p>', 1, 0, '2024-06-19 11:01:04', NULL, NULL, 'sistema-de-protese-de-ombro-comprehensive', 'sistema-de-protese-de-ombro-comprehensive.jpg', 'Técnica Cirúrgica - Anatômica', 'sistema-de-protese-de-ombro-comprehensive.pdf', 'Técnica Cirúrgica - Reversa', 'sistema-de-protese-de-ombro-comprehensive.pdf', 'Catálogo', 'sistema-de-protese-de-ombro-comprehensive.pdf', NULL),
(30, 1, 41, 'Âncoras FastLock', 'Âncoras em PEEK sem nó com ilhós, fio e fita para ILA – Internal Ligament Augmentation e Fastbridge – Técnica Double Row no tratamento de lesões e reinserção tendíneas.', 'Âncora em peek fastlock', '1', '<p>As âncoras Fastlock são fabricadas em PEEK e fornecidas já montadas em seu cabo insertor e carregadas com fitas de alta resistência. O produto foi desenvolvido para realização de ILA - “Internal Ligament Augmentation” no tratamento das lesões ligamentares, e FASTBRIDGE - Técnica “Double Row” para o tratamento de lesões ou reinserções tendíneas. O ilhós da âncora transporta a fita até o fundo do orifício confeccionado e a âncora, utilizando-se do princípio de interferência, realiza a fixação sem aplicação de nós - tecnologia “Knotless”.</p><p> </p><ul><li>Âncoras de Ø2.5 mm e Ø3.5 mm com ilhós aberto e ilhós fechado, comercializadas montadas no cabo insertor e carregadas com fita;</li><li>Âncoras de Ø4.75 mm e 5.5 mm com ilhós fechado, comercializadas montadas no cabo insertor e carregadas com fio e fita;</li><li>A fita de alta resistência, juntamente com as âncoras, atua como cinto de segurança, protegendo os tecidos tratados durante sua cicatrização;</li><li>Reabilitação acelerada;</li><li>Permite técnica de implantação minimamente invasiva;</li><li>Ausência de nós evita incômodo e irritação de tecidos moles;</li><li>Fios e fitas de alta resistência fabricados em UHMWPE (polietileno de ultra-alto peso molecular), traçados e não absorvíveis;</li><li>Matéria-prima: PEEK conforme norma ASTM F 2026.</li></ul><p> </p>', '<ul><li>Ligamento cromioclavicular do ombro</li><li>Ligamento Colateral Medial do joelho</li><li>Ligamento Colateral Ulnar do cotovelo</li><li>Articulação Radioulnar Distal (ARUD)</li><li>Ligamento Colateral Ulnar do polegar</li><li>Ligamento Escafolunar da mão</li><li>Ligamento Tibiofibular Inferior Anterior (AITFL)</li><li>Ligamento Mola + Deltoide</li><li>Ligamento Talofibular Anterior (ATFL)</li></ul>', 1, 0, '2024-06-19 11:05:04', NULL, NULL, 'ancoras-fastlock', 'ancoras-fastlock.jpg', 'Catálogo Geral - Fastlock', 'ancoras-fastlock.pdf', '', NULL, '', NULL, NULL),
(31, 1, 41, 'Âncora HTA – HEADLESS TITANIUM ANCHOR', 'Âncoras desenvolvidas para o reparo de lesões ligamentares e tendíneas, com diversas opções de diâmetros e comprimentos para melhor adequação a cada região de implantação.', 'A DEFINIR', '1', '<p>Todas as âncoras são montadas em cabo insertor com os agulhados, fabricados com o polímero UHMWPE (polietileno de ultra alto peso molecular), biocompatíveis e com alta resistência contra: abrasão, quebra, alongamento, afrouxamento ou soltura de nós</p><ul><li>Conexão interna da âncora com o cabo insertor proporciona PERFIL ZERO, reduzindo incômodo e irritação de tecidos moles;</li><li>Todas as âncoras são montadas em cabo insertor com os fios agulhados, fabricados com o polímero UHMWPE (polietileno de ultra alto peso molecular), biocompatíveis e com alta resistência contra: abrasão, quebra, alongamento, afrouxamento ou soltura de nós;</li><li>Nano HTA Ø1.7 mm x 5.0 mm;</li><li>Micro HTA Ø2.2 mm x 4.0 mm;</li><li>Mini HTA Ø2.7 mm x 7.0 mm;</li><li>HTA Ø3.5 mm x 10.0 mm;</li><li>Max HTA Ø5.0 mm x 14.0 mm;</li></ul>', '<p>A DEFINIR</p>', 1, 0, '2024-06-19 11:06:46', NULL, NULL, 'ancora-hta-headless-titanium-anchor', 'ancora-hta-headless-titanium-anchor.jpg', 'Catálogo', 'ancora-hta-headless-titanium-anchor.pdf', '', NULL, '', NULL, NULL),
(32, 1, 41, 'Expert Knotless – Fixador Flexível De Articulação', 'Sistema de fixação flexível para a articulação tibiofibular distal para o tratamento das lesões da sindesmose', '', '1', '<p>Os produtos Expert Knotless e Expert Knotless Dual foram desenvolvidos para a fixação flexível da sindesmose tibiofibular distal, no tratamento das lesões instáveis do tornozelo, com ou sem fratura associada.</p><ul><li><p>Possibilidade de utilização individual ou em par, inclusive acoplado em orifício de placa para fíbula GMReis;</p></li><li><p>Ausência de nós evita incômodo e irritação de tecidos moles;</p></li><li><p>Escores clínicos melhores, se comparado com a técnica de fixação da sindesmose com parafuso:</p><ul><li><p>Taxas mais baixas de complicações relacionadas à quebra do implante;</p></li><li><p>Menor taxa de reoperação para remoção do implante;</p></li><li><p>Suporte de carga corporal total precoce.</p></li></ul></li></ul><ul><li><p>Fios e malha de alta resistência fabricados em UHMWPE (polietileno de ultra-alto peso molecular), trançados e não absorvíveis;</p></li><li><p>Matéria-prima: Titanio 6Al4V conforme norma ASTM F 136.</p></li></ul>', '<p>Tratamento das lesões da sindesmose, com ou sem fratura do tornozelo associada.</p><p> </p>', 1, 0, '2024-06-19 11:08:58', NULL, NULL, 'expert-knotless-fixador-flexivel-de-articulacao', 'expert-knotless-fixador-flexivel-de-articulacao.jpg', 'Catálogo', 'expert-knotless-fixador-flexivel-de-articulacao.pdf', '', NULL, '', NULL, NULL),
(33, 1, 41, 'NitFix – Grampos para Fixação', 'Desenvolvido para fixação e estabilização dos ossos das extremidades superiores e inferiores.', '', '1', '<p>O NitFix permite ao cirurgião, devido a sua geometria específica, a consolidação óssea dos fragmentos, na posição anatômica correta. É um componente implantável que proporciona um meio de osteossíntese no tratamento de fraturas, osteotomias e artrodeses.</p><p>Diferente da compressão estática promovida por implantes de fixação rígida, onde, com o tempo, devido as propriedades viscoelásticas do osso levarem ao relaxamento de tensão e assim, reduzirem a compressão inicial do implante, os implantes NitFix são capazes de manter a compressão contínua após a implantação. Como resultado, o grampo promoverá uma redução e compressão dinâmica dos fragmentos ósseos, mantendo-os juntos até sua consolidação.</p><ul><li><p>Fabricados em liga de Nitinol Superelástico BB (ASTM F2063)</p></li><li><p>Propriedades elásticas à temperatura ambiente</p></li><li><p>Design com perfil baixo, reduzindo irritação nos tecidos moles</p></li><li><p>Compressão óssea constante após ser implantado</p></li><li><p>Diversos tamanhos e geometrias para se ajustar as diferentes estruturas anatômicas dos ossos do pé e da mão</p></li><li><p>Espessura variável entre modelos</p></li><li><p>Ótima biocompatibilidade</p></li><li><p>Modelos anatômicos, contorno suave em toda a sua extensão</p></li><li><p>Não necessita de preparação prévia para a inserção</p></li></ul>', '<ul><li>Osteotomia de pé valgo ou varo;</li><li>Correção de deformidades;</li><li>Osteotomia de metatarso;</li></ul><p> </p>', 1, 0, '2024-06-19 11:10:29', NULL, NULL, 'nitfix-grampos-para-fixacao', 'nitfix-grampos-para-fixacao.jpg', 'Catálogo', 'nitfix-grampos-para-fixacao.pdf', 'Manual', 'nitfix-grampos-para-fixacao.pdf', '', NULL, NULL),
(34, 1, 36, 'Sistema de Haste Wagner SL para Prótese de Revisão de Quadril', 'A Haste Wagner SL foi projetada para unir defeitos ósseos proximais para obter fixação distal e estabilidade rotacional.', 'Haste Wagner para Prótese de Revisão de Quadril', '1', '<p>Recursos do sistema<br />Superfície comprovadamente jateada e uma liga de titânio biocompatível.</p><p> </p><p>Estabilidade rotacional<br />Um corpo de implante cônico e oito nervuras longitudinais fornecem estabilidade rotacional e permitem o ajuste da anteversão intraoperatória.</p><p> </p><p>Gama de tamanhos<br />Vários diâmetros e comprimentos de implantes estão disponíveis para um ajuste desejado pelo paciente.</p>', '<ul><li>Artroplastia Total de Quadril</li><li>Prótese de Revisão de Quadril</li><li>Reconstrução Femoral</li></ul>', 1, 0, '2024-06-19 11:12:27', NULL, NULL, 'sistema-de-haste-wagner-sl-para-protese-de-revisao-de-quadril', 'sistema-de-haste-wagner-sl-para-protese-de-revisao-de-quadril.jpg', 'Catálogo', 'sistema-de-haste-wagner-sl-para-protese-de-revisao-de-quadril.pdf', 'Técnica Cirúrgica', 'sistema-de-haste-wagner-sl-para-protese-de-revisao-de-quadril.pdf', '', NULL, NULL),
(35, 1, 36, 'Sistema Acetabular de Dupla Mobilidade G7 ', 'O Sistema Acetabular G7 foi projetado especificamente para simplificar a entrega de implantes e instrumentos para eficiência operacional otimizada e desempenho clínico maximizado.', 'Sistema Acetabular de Dupla Mobilidade G7 ', '1', '<p>Simplicidade, Eficiência, Desempenho</p><p><br />Desde artroplastia primária simples até artroplastia de revisão complexa, o Sistema Acetabular G7® da Zimmer Biomet é um sistema modular que oferece um portfólio abrangente de opções de revestimento, fixação e suporte para estabelecer uma articulação estável em ATQ. A simplicidade, eficiência e desempenho da plataforma são projetados para atender às necessidades distintas de pacientes individuais, dando aos cirurgiões e hospitais o poder de personalizar a seleção de implantes combinada com uma plataforma simplificada de instrumentação e entrega.</p>', '<p>Artroplastia Total do Quadril<br />Reconstrução Acetabular<br />Prótese de Quadril Primária</p><p> </p>', 1, 1, '2024-06-19 11:15:16', NULL, '2024-06-19 11:15:22', 'sistema-acetabular-de-dupla-mobilidade-g7', 'sistema-acetabular-de-dupla-mobilidade-g7.jpg', 'Catálogo', 'sistema-acetabular-de-dupla-mobilidade-g7.pdf', 'Técnica Cirúrgica', 'sistema-acetabular-de-dupla-mobilidade-g7.pdf', '', NULL, NULL),
(36, 1, 36, 'Sistema Acetabular Trilogy® IT', 'Material de fibra metálica clinicamente comprovado', 'Descrever o nome deste produto no kit solicitado', '1', '<p>Para os cirurgiões ortopédicos que tratam uma vasta gama de doentes, o sistema acetabular Trilogy IT proporciona um material de fibra metálica clinicamente comprovado e a capacidade de escolher as opções avançadas de suporte que melhor se adaptam às necessidades individuais do doente.</p><p> </p><p>Capacidade para escolher as tecnologias avançadas de suporte adaptadas às exigências do doente. O polietileno com elevada ligação cruzada Longevity ® é altamente resistente ao desgaste e ao envelhecimento, com mais de dez anos de história clínica comprovada.</p><p> </p><p>A tecnologia Metasul ® Technology tem uma taxa de desgaste muito reduzida, com mais de vinte anos de história clínica. A cerâmica BIOLOX ® delta † proporciona uma taxa de desgaste muito reduzida num material com propriedades mecânicas melhoradas em relação à cerâmica tradicional.</p><p> </p><p><strong>LONGEVITY® HIGHLY CROSSLINKED</strong></p><p>O&nbsp;<em>Liner Longevity® Highly Crosslinked Polyethylene</em>&nbsp;oferece ao cirurgião ortopédico um polietileno altamente avançado em superfícies de apoio. Ele também fornece uma superfície de rolamento de baixo desgaste clinicamente comprovada que é resistente ao envelhecimento</p><p> </p><p> </p><p> </p>', '<p>Prótese Total de Quadril Primária<br />Artroplastia Total de Quadril</p>', 1, 0, '2024-06-19 14:21:46', NULL, NULL, 'sistema-acetabular-trilogyr-it', 'sistema-acetabular-trilogyr-it.jpg', 'Catálogo', 'sistema-acetabular-trilogyr-it.pdf', 'Técnica Cirúrgica', 'sistema-acetabular-trilogyr-it.pdf', '', NULL, NULL),
(37, 1, 36, 'Componente Acetabular Polietileno Cimentado ZCA', 'Acetábulo Polietileno Cimentado ZCA Zimmer', 'DESCREVER NO KIT SOLICITADO', '1', '<p>Os Acetábulos Polietileno Cimentados&nbsp;<em>ZCA Zimmer</em>&nbsp;são próteses acetabulares para utilização em artroplastia total do quadril. É fabricado a partir de polietileno ultra alto peso molecular (UHMWPE), convencionais e&nbsp;<em>Longevity</em>&nbsp;altamente reticulado. Fios radiopacos, fabricados em aço inoxidável 316L, são fornecidos no polo e o equador da cápsula para ajudar a avaliar a posição da cápsula através de raios-x.</p><p> </p><p>Os Acetábulos Polietileno Cimentados ZCA Zimmer são fabricados em polietileno de peso molecular ultra-elevado (UHMWPE). Estão disponíveis nas configurações neutra, com face inclinada, rebordo e encaixe, com ou sem os espaçadores de polimetilmetacrilato (PMMA), e em vários diâmetros internos e externos.</p><p> </p><p>Todas, com exceção da Cápsula Snap-in são oferecidas em uma seleção de quatro diâmetros internos de 22mm, 26mm, 28mm e 32mm. A Cápsula Snap é oferecida apenas no diâmetro interior de 32 milímetros. As cápsulas estão disponíveis em uma variedade de diâmetros externos (em incrementos de 2mm).</p><p> </p><p>Todas as cápsulas são fornecidas com quatro espaçadores em (poli metacrilato de metila) (PMMA) posicionados estrategicamente em áreas de tensão, para ajudar a centralizar a cápsula e criar um manto uniforme de cimento. O diâmetro externo inclui os espaçadores.</p><p> </p><p>Os Acetábulos Polietileno Cimentados&nbsp;<em>ZCA Zimmer</em>&nbsp;podem ser cimentados diretamente no acetábulo preparado ou utilizadas em conjunto com um&nbsp;<em>ZCA Roof Ring</em>&nbsp;ou&nbsp;<em>Cage</em>&nbsp;para reconstruções acetabulares mais complexas.</p><p> </p><p><strong>Disponíveis em cinco configurações:</strong></p><p>• Face neutra</p><p>• Face neutra com flange circunferencial</p><p>• Face Inclinada (10º)</p><p>• Face Inclinada (10º) enfrentam com flange circunferencial</p><p>• Cápsula Snap-in</p>', '<p>O Acetábulo Polietileno Cimentado&nbsp;<em>ZCA Zimmer</em>&nbsp;está indicada para utilização cimentada em indivíduos esqueleticamente maduros submetidos a cirurgia primária ou de revisão para reabilitação de quadril danificadas em consequência de doença degenerativa articular não inflamatória (DDANI) ou de diagnósticos compostos de osteoartrite, necrose avascular, artrite traumática, epífise capital deslizada, quadril fundido, fratura da pelve e a variante distrófica. O revestimento da cápsula de revisão Trabecular Metal está indicado para utilização cimentada com a cápsula de revisão Trabecular Metal na colocação inicial ou como superfície de apoio em polietileno para reposição no local devido à instabilidade, desgaste e/ou danos na articulação.</p><p> </p>', 1, 0, '2024-06-19 14:24:29', NULL, NULL, 'componente-acetabular-polietileno-cimentado-zca', 'componente-acetabular-polietileno-cimentado-zca.jpg', 'Técnica Cirúrgica', 'componente-acetabular-polietileno-cimentado-zca.pdf', '', NULL, '', NULL, NULL),
(38, 1, 36, 'Sistema De Placas Para Fratura Cable Ready®', 'Cable-Ready® da Zimmer Biomet é projetado para incorporar o cabo na placa. O cabo é parte integrante da placa e não apenas passa através da placa, mas está fixo à placa.', 'Placa Reta De Cerclagem Cableready', '1', '<p>Esta placa óssea é distinta porque o cabo é seguro internamente em um mecanismo de baixo perfil. Cada cabo é travado girando em um parafuso de fixação. O mesmo tensor é usado como encontrado em um conjunto de instrumentos pronto para o cabo. O único adicional de peça de equipamento necessária para este sistema de placa é um Bit tensor.</p><p> </p><p>O objetivo de combinar os parafusos e cabos com a placa&nbsp;<em>Cable-Ready®</em>&nbsp;é para ajudar a proteger o osso tanto internamente como externamente. Os parafusos ósseos são eficazes na resistência a torção e os cabos são eficazes na resistência à flexão e extensão. A placa&nbsp;<em>Cable-Ready®</em>&nbsp;também é eficaz quando parafusos não podem ser usados, como quando uma prótese ocupa o canal do osso. A placa&nbsp;<em>Cable-Ready®</em>&nbsp;é projetada para suportar o carregamento axial devido à coluna suporte dos cabos.</p>', '<p>A placa&nbsp;<em>Cable-Ready®</em>&nbsp;é projetada para lidar com problemas fraturas ou reconstrução do fêmur ou tíbia. Exemplos de possíveis usos para a placa óssea incluem fraturas abaixo ou acima da prótese, cominutivas fraturas da diáfise femoral (proximal e distal), reconstrução de defeitos ósseos e revisões do total artroplastia total de quadril ou joelho com perda óssea ou fraturas.</p>', 1, 0, '2024-06-19 14:33:00', NULL, NULL, 'sistema-de-placas-para-fratura-cable-readyr', 'sistema-de-placas-para-fratura-cable-readyr.jpg', 'Técnica Cirúrgica', 'sistema-de-placas-para-fratura-cable-readyr.pdf', '', NULL, '', NULL, NULL),
(39, 1, 36, 'Sistema de Hastes para quadril CPT', 'A solução simples e comprovada', 'Kit Protese Quadril Hibrida (Descrever Todos Os Componentes)', '1', '<p>O conceito de design polido e de cone duplo usado no Sistema de Quadril&nbsp;<em>CPT</em>&nbsp;foi comprovado clinicamente em mais de 25 anos de uso. Esta filosofia distinta de design é baseada no uso de forças compressivas naturais para garantir que o implante fique firmemente assentado e soldado no manto de cimento. O sistema CPT, em cromo-cobalto e aço inoxidável tem obtido sucesso clínico de longo prazo desde seu lançamento no início da década de 1990.</p><p> </p><p>Maior amplitude de movimento: geometria de pescoço reduzida, maior tamanho da cabeça e Revestimentos de Polietileno com Ligações Altamente Cruzadas&nbsp;<em>Longevity®</em>&nbsp;oferecem maior amplitude de movimento e estabilidade da articulação.</p>', '<p>Artroplastia Total de Quadril Primária Cimentada</p><p> </p>', 1, 0, '2024-06-19 14:38:07', NULL, NULL, 'sistema-de-hastes-para-quadril-cpt', 'sistema-de-hastes-para-quadril-cpt.jpg', 'Catálogo', 'sistema-de-hastes-para-quadril-cpt.pdf', 'Técnica Cirúrgica', 'sistema-de-hastes-para-quadril-cpt.pdf', '', NULL, NULL),
(40, 1, 36, 'Sistema de Hastes para Quadril ML Taper', 'Design Simplesmente Conservador', 'Kit Protese Quadril Não Cimentada (Descrever Todos Os Componentes)', '1', '<p>A prótese de quadril cônica&nbsp;<em>Zimmer®</em>&nbsp;M/L oferece uma alternativa simples para pacientes com estoque ósseo adequado. A prótese sem anel otimiza a fixação de cunha cônica oferecendo estabilidade mediolateral segura.&nbsp; A haste está disponível em 14 tamanhos, que vão de 4 mm a 22,5 mm, com offsets padrão e estendidos.</p><p> </p><p>O projeto de cunha cônica oferece encaixe da cunha para estabilidade mediolateral. A dimensão A/P esguia preserva osso e fornece excelente estabilidade torsional.&nbsp;<em>A liga Tivanium</em>&nbsp;®&nbsp;Ti-6Al-4V oferece excelente biocompatibilidade e resistência sem rigidez excessiva.</p><p> </p><p>O Spray de Plasma Circunferencial facilita a fixação mecânica para uma interface segura entre osso e implante. O Ressalto Lateral Minimizado ajuda a preservar o osso e facilita a inserção. Offsets padrão e estendido fornecem opções de offset anatômico para facilitar o tensionamento de tecido mole. Maiores offsets são obtidos com um deslocamento paralelo do pescoço sem afetar o comprimento da perna nem alterar o ângulo do pescoço do componente.</p><ul><li><p>O Cone de Pescoço 12/14 acomoda uma completa seleção de cabeças femorais de metal, com opções de centro da cabeça de -3,5 mm, +0 mm, +3,5 mm, +7,0 mm e +10,5 mm</p></li><li><p>A geometria reduzida de pescoço abaixo do cone 12/14 permite uma amplitude de movimento otimizada</p></li><li><p>Superfícies altamente polidas são projetadas para facilitar a inserção e funcionar em conjunto com a geometria do cone</p></li><li><p>As ranhuras distais fornecem um canal para sangue e detritos durante a inserção</p></li><li><p>A instrumentação fácil de usar é projetada para oferecer flexibilidade intraoperativa</p></li><li><p>As opções de instrumentos de inserção oferecem opções de Inserção de Haste com Conexão Rápida e dois acionadores de haste, um para controle rotacional e outro para liberdade rotacional</p></li></ul>', '<p>Artroplastia Total de Quadril Primária Não Cimentada</p><p> </p>', 1, 0, '2024-06-19 14:39:59', NULL, NULL, 'sistema-de-hastes-para-quadril-ml-taper', 'sistema-de-hastes-para-quadril-ml-taper.jpg', 'Catálogo', 'sistema-de-hastes-para-quadril-ml-taper.pdf', 'Técnica Cirúrgica', 'sistema-de-hastes-para-quadril-ml-taper.pdf', '', NULL, NULL),
(41, 1, 36, 'Sistema de Haste Wagner Cone para Prótese de Quadril', 'A Haste da Prótese Cone Wagner foi projetada para fixação não cimentada, abordando condições ósseas na extremidade proximal do fêmur e para casos de displasia congênita do quadril.', 'KIT PROTESE TOTAL DE QUADRIL COM FIXAÇÃO DISTAL', '1', '<p>A Haste da Prótese Cone Wagner foi projetada para fixação não cimentada em condições ósseas difíceis na extremidade proximal do fêmur e para casos de HDC.</p><p> </p><p>A superfície da prótese é jateada o que, aliado ao formato característico, promove aposição óssea em grande área.</p><p> </p><p>A haste cônica circular não está sujeita a nenhuma força de rotação durante a inserção, ou seja, o ângulo de antetorsão pode ser determinado pelo cirurgião. O caule possui 8 nervuras longitudinais. As cristas relativamente afiadas das nervuras cortam o osso, permitindo assim uma ótima estabilidade rotacional. Isto também explica o fato de que a dor típica na coxa associada a alguns sistemas protéticos não cimentados é praticamente desconhecida na Prótese Wagner Cone.</p><p> </p><p>Além de proporcionar estabilidade rotacional, as nervuras longitudinais afiadas da haste também são benéficas para a aposição óssea. As investigações de Schenk mostraram muito claramente que o osso se forma e se fixa preferencialmente nas proeminências com arestas vivas do implante e menos nas cavidades da superfície.</p><p> </p><p>Para conseguir um suporte amplo da prótese na região do calcar, a nervura medial é inserida distalmente a esta área na superfície de suporte convexa. As nervuras da parte lateral partem da ponta para garantir maior área de contato possível no trocânter, isso proporciona estabilidade rotacional e melhora a osseointegração.</p><p> </p><p>Como o ângulo CCD e o deslocamento não são valores constantes, a Haste da Prótese Wagner Cone está agora disponível em 2 ângulos CCD diferentes, 125° e 135°. Isto proporciona uma gama mais ampla de opções de deslocamento, o que permite uma restauração adequada de parâmetros biomecânicos, como o centro de rotação, o ângulo CCD e o comprimento da perna.</p><p> </p><p>Ambas as versões estão disponíveis em 12 diâmetros de 13 a 24 mm para se adaptarem à largura individual do canal medular.</p>', '<p>Artroplastia Total de Quadril Primária</p><p> </p>', 1, 0, '2024-06-19 14:41:25', NULL, NULL, 'sistema-de-haste-wagner-cone-para-protese-de-quadril', 'sistema-de-haste-wagner-cone-para-protese-de-quadril.jpg', 'Técnica Cirúrgica', 'sistema-de-haste-wagner-cone-para-protese-de-quadril.pdf', '', NULL, '', NULL, NULL);
