(42, 1, 36, 'Aumentos em Metal Tântalo Trabecular™ para Revisão de Quadril - TMARS', 'The Best Thing Next to Bone', 'Aumento Acetabular Trabecular Metal', '1', '<p>A Tecnologia Metal Tântalo Trabecular™ é uma superfície de fixação avançada projetada para implantes ortopédicos. Com um alto coeficiente de fricção (0,98), ele fornece um excelente encaixe por atrito inicial. Diferentemente de revestimentos e outras superfícies, o Metal Tântalo Trabecular™ tem porosidade de até 80%, aumentando o potencial de incorporação óssea e vascularização do tecido mole. Com sua arquitetura de estrutura nanotexturizada, o Metal Tântalo Trabecular™ é similar ao osso canceloso em estrutura, função e fisiologia.</p><p> </p><p><strong>Estrutura</strong></p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Porosidade de até 80%;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tamanho de poros consistente e poros 100% interconectados facilita, a incorporação biológica;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A combinação de resistência e elasticidade do Tântalo elementar;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tamanho médio de poro de 44µm;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Baixo módulo de elasticidade;</p><p> </p><p><strong>Função</strong></p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Alto coeficiente de fricção para maior estabilidade;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Baixo módulo de elasticidade similar a osso canceloso para carregamento fisiológico mais normal que tem o potencial de reduzir a remodelação óssea;</p><p> </p><p><strong>Fisiologia</strong></p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; O Tântalo elementar é quimicamente estável e biologicamente inerte;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A estrutura suporta integração do osso, remodelação do osso e vascularização;</p><p>•&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Estrutura de superfície nanotexturizada;</p><p> </p><p>O Metal Tântalo Trabecular™ é amplamente usado no portfólio de produtos da Zimmer, incluindo implantes de quadril, joelho e ombro, aplicações de traumatologia, implantes de coluna, preenchimento de Iacunas ósseas e aumentos, parafusos AVN e implantes dentários.</p><p> </p><p><strong>Material</strong></p><p>O material Metal Tântalo Trabecular™ é feito de Tântalo elementar (peso atômico 73), um dos metais mais estáveis quimicamente e inertes fisiologicamente usados em implantes ortopédicos, o que o torna altamente biocompatível e resistente a corrosão. O Tântalo é o material ideal para essa estrutura de incorporação porque tem resistência a fadiga e um módulo compressivo que permite que ele flexione antes de quebrar. O Metal Tântalo Trabecular™ é produzido em uma instalação dedicada em Parsippany, Nova Jersey. Utilizando um processo exclusivo de deposição térmica, o Tântalo é depositado em um substrato, criando uma topografia de superfície nanotexturizada e construindo o Metal Tântalo Trabecular™ um átomo de cada vez.</p><p> </p><p><strong>Clínica</strong></p><p>A tecnologia Metal Tântalo Trabecular™ da Zimmer tem mais de 15 anos de histórico clínico, e o desempenho de componentes específicos em pacientes humanos foi bem documentado em mais de 250 artigos e abstracts revistos por pares. Estudos independentes confirmaram as propriedades estruturais e mecânicas do material Metal Tântalo Trabecular™.</p>', '<p>Prótese de Quadril Revisão</p>', 1, 1, '2024-06-19 14:43:30', NULL, '2024-06-19 17:47:04', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-quadril-tmars', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-quadril-tmars.jpg', 'Catálogo', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-quadril-tmars.pdf', 'Técnica Cirúrgica', 'aumentos-em-metal-tantalo-trabeculartm-para-revisao-de-quadril-tmars.pdf', '', NULL, NULL);
