(21, 'Novo Chamado com Problema', 39, '<p><strong>Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>', '3', NULL, 'novo-chamado-com-problema.jpg', '4', '2024-05-13 18:52:35', NULL, 'novo-chamado-com-problema', NULL, NULL, 'Não será mais necessário utilização', 0.00, '00:00:00', '00:00:00', 0.00, 0.00),
