(40, 'Novo Chamado Criado na tela x', 39, '<p>O que é Lorem Ipsum?</p><p><strong>Lorem Ipsum</strong>&nbsp;é simplesmente uma simulação de texto da indústria tipográfica e de impressos, e vem sendo utilizado desde o século XVI, quando um impressor desconhecido pegou uma bandeja de tipos e os embaralhou para fazer um livro de modelos de tipos. Lorem Ipsum sobreviveu não só a cinco séculos, como também ao salto para a editoração eletrônica, permanecendo essencialmente inalterado. Se popularizou na década de 60, quando a Letraset lançou decalques contendo passagens de Lorem Ipsum, e mais recentemente quando passou a ser integrado a softwares de editoração eletrônica como Aldus PageMaker</p>', '2', NULL, 'novo-chamado-criado-na-tela-x.jpg', '1', '2024-05-13 21:57:00', NULL, 'novo-chamado-criado-na-tela-x', NULL, NULL, NULL, 0.00, '00:00:00', '00:00:00', 0.00, 0.00),
